    :has_definition "An autoimmune polyendocrine syndrome that is characterized by abnormal functioning of the immune system that causes auto-reactivity against endocrine organs. It is more heterogeneous and has not been linked to one gene." ;
    :has_exact_synonym "Schmidt syndrome"@en .

