        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        :hantavirus_hemorrhagic_fever_with_renal_syndrome ;
    :has_definition "A hemorrhagic fever with renal syndrome that results_in infection located_in kidney, has_material_basis_in Hantaan virus, which is transmitted_by the eurasian field mouse, Apodemus agrarius, or has_material_basis_in Seoul virus, which is transmitted_by norwegian rat, Rattus norvegicus. The infection has_symptom headache, has_symptom back pain, has_symptom abdominal pain, has_symptom fever, has_symptom chills, has_symptom nausea, has_symptom blurred vision, has_symptom flushing of the face, has_symptom redness of the eyes, has_symptom rash, has_symptom low blood pressure, has_symptom acute shock, has_symptom vascular leakage, and has_symptom acute kidney failure, which can cause severe fluid overload." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nephropathia_epidemica rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :renal_failure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :myodes_glareolus ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :backache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :orthohantavirus_puumalaense ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        :hantavirus_hemorrhagic_fever_with_renal_syndrome ;
    :has_definition "A hemorrhagic fever with renal syndrome that results_in infection located_in kidney, has_material_basis_in Orthohantavirus puumalaense, which is transmitted_by bank vole, Myodes glareolus [NCBITaxon:447135]. The infection has_symptom headache, has_symptom nausea, has_symptom back pain, has_symptom vomiting, has_symptom myalgia, has_symptom abdominal pain, has_symptom internal hemorrhage, and has_symptom renal failure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lujo_hemorrhagic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bleeding ],
        :viral_infectious_disease ;
    :has_definition "A viral infectious disease that results_in infection, has_material_basis_in Lujo virus, which has_symptom bleeding." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epstein_barr_virus_hepatitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :human_gammaherpesvirus_4 ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fatigue ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :jaundice ],
        :epstein_barr_virus_infectious_disease,
        :viral_hepatitis ;
    :has_definition "A viral hepatitis that results_in inflammation, located_in liver, has_material_basis_in Human herpesvirus 4 and has_symptom headache, has_symptom fatigue, has_symptom fever, has_symptom abdominal pain, has_symptom nausea, and has_symptom jaundice." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:swine_influenza rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :pharynx_inflammation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rhinorrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :influenza_a_virus ;
                            rdf:rest [ rdf:first :influenza_c_virus ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        :influenza ;
    :has_definition "An influenza that results_in infection located_in respiratory tract of pigs and humans, has_material_basis_in Influenza C virus, or has_material_basis_in Influenza A virus subtypes (H1N1, H1N2, H3N1, H3N2, and H2N3), which are transmitted_by direct contact with infected pigs. The infection in humans has_symptom fever, has_symptom lethargy, has_symptom lack of appetite, has_symptom coughing, has_symptom runny nose, has_symptom sore throat, has_symptom nausea, has_symptom vomiting, and has_symptom diarrhea." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lambert_eaton_myasthenic_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_immunoglobulin_level ],
        :autoimmune_disease_of_musculoskeletal_system,
        :autoimmune_disease_of_peripheral_nervous_system,
        :neuromuscular_junction_disease ;
    :has_definition "A neuromuscular junction disease that is characterized by an abnormality of acetylcholine (ACh) release at the neuromuscular junction which results from an autoimmune attack against voltage-gated calcium channels (VGCC) on the presynaptic motor nerve terminal." ;
    :has_exact_synonym "Eaton-Lambert syndrome"@en,
        "LEMS"@en,
        "Lambert-Eaton syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polycystic_echinococcosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :liver ],
        :echinococcosis,
        :liver_disease ;
    :has_definition "An echinococcosis that is caused by the larvae of Echinococcus vogeli or Echinococcus oligarthrus, which infect the liver." ;
    :has_exact_synonym "human polycystic hydatid disease"@en,
        "neotropical echinococcosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:selective_igm_deficiency_disease rdfs:subClassOf :dysgammaglobulinemia ;
    :has_definition "A selective immunoglobulin deficiency disease thatis a dysgammaglobulinemia resulting from decreased levels of immunoglobulin M (IgM) production to roduction of other antibodies." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_amebic_meningoencephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :delirium ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :coma ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :seizure ],
        :central_nervous_system_disease,
        :parasitic_protozoa_infectious_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :parasitic_protozoa_infectious_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_nervous_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A parasitic protozoa infectious disease that involves infection of the central nervous system caused by Naegleria fowleri. The symptoms include headache, nausea, rigidity of the neck muscles, vomiting, delirium, seizures and coma." ;
    :has_exact_synonym "Naegleria fowleri infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:granulomatous_amebic_encephalitis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :altered_mental_status ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :brain ],
        :brain_disease,
        :primary_amebic_meningoencephalitis ;
    :has_definition "A parasitic protozoa infectious disease that results in infection of the brain caused by Acanthamoeba or Balamuthia mandrillaris. The symptoms include headaches, altered mental status, and focal neurologic deficit, which progresses over several weeks to death." ;
    :has_exact_synonym "Acanthamoeba encephalitis"@en,
        "Acanthamoeba granulomatous encephalitis"@en,
        "Granulomatous Amebic Encephalitis due to Acanthamoeba"@en,
        "granulomatous amoebic encephalitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:philophthalmiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        :eye_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the eyes by Philophthalmus species. External ocular philophthalmiasis manifests as follicular conjunctivitis and superficial keratitis. Sub-conjunctival ocular philophthalmiasis consists of a mild edema with minimal cellular reaction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coenurosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :central_nervous_system ] ;
                            rdf:rest :nil ] ] ],
        :central_nervous_system_disease,
        :parasitic_helminthiasis_infectious_disease,
        :skin_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves infection by metacestode larval stage (coenurus) of Taenia multiceps or Taenia serialis. Coenuri in the skin or subcutaneous tissue present as painless nodules, which manifest on the trunk, sclera, subconjuctiva, neck, shoulders, head and limbs. Coenuri in the central nervous system may cause headache, fever, vomiting, nerve palsies, jacksonian epilepsy, pachymeningitis, obstructive or communicating hydrocephalus, and intracranial arteritis with transient hemiparesis. Coenuri in the eye cause both intraocular and orbital infections." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesocestoidiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_discomfort ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic cestode infection caused by Mesocestoides lineatus resulting in nausea, diarrhea, abdominal discomfort and vomiting." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acanthocephaliasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bloody_stool ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :constipation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :decreased_appetite ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_distention ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves infection of the intestine caused by thorny-headed worms Macracanthorhynchus or Moniliformis moniliformis. The infection has_symptom abdominal pain, has_symptom distension, has_symptom fever, has_symptom decreased appetite, has_symptom nausea, has_symptom vomiting, has_symptom weight loss, has_symptom diarrhea, and has_symptom constipation or has_symptom bloody stools." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:angiostrongyliasis rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :intestine ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :eye ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :central_nervous_system ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :angiostrongylus ],
        :central_nervous_system_disease,
        :eye_disease,
        :intestinal_disease,
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the intestine, central nervous system and eyes by Angiostrongylus cantonensis or Angiostrongylus costaricensis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:baylisascariasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blindness ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :intestine ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :eye ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :disease_has_location ;
                                                    owl:someValuesFrom :spinal_cord ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :brain_disease,
        :eye_disease,
        :intestinal_disease,
        :parasitic_helminthiasis_infectious_disease,
        :spinal_cord_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection of the intestine caused by the larvae of Baylisascaris procyonis, which can invade the spinal cord, brain, and eye of humans, resulting in permanent neurologic damage, blindness, or death." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dioctophymiasis rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :kidney ] ;
                            rdf:rest :nil ] ] ],
        :kidney_disease,
        :parasitic_helminthiasis_infectious_disease,
        :skin_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that involves parasitic infection by the nematode Dioctophyme renale in humans after eating undercooked food. The larvae are found in the subcutaneous nodules and kidneys." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thelaziasis rdfs:subClassOf :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious diseasea that involves infection of the eyes in humans by nematode Thelazia callipaeda causing varying degrees of inflammation and lacrimation. In heavier infections, photophobia, edema, conjunctivitis, and blindness occurs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tungiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :itching ],
        :parasitic_ectoparasitic_infectious_disease ;
    :has_definition "A parasitic ectoparasitic infectious disease that is an inflammatory skin disease caused by the parasitic infestation of the female chigoe flea, Tunga penetrans in animals and humans. The symptoms include skin inflammation, severe pain, itching, and a lesion at the site of infection that is characterized by a black dot at the center of a swollen red lesion, surrounded a white halo." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ophthalmomyiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        :eye_disease,
        :myiasis ;
    :has_definition "A myiasis that involves parasitic infestation of Oestrus ovis larvae in the eye causing severe irritation, edema, and pain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichomonas_vaginalis_trichomoniasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :uterine_cervix ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urethra ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :vagina ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :disease_has_location ;
                                                    owl:someValuesFrom :mammalian_vulva ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :relapsing_fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trichomonas_vaginalis ],
        :cervix_disease,
        :trichomoniasis,
        :urethral_disease,
        :vaginal_disease,
        :vulvar_disease ;
    :has_definition "A trichomoniasis that involves infection of the urogenital tract, has_material_basis_in Trichomonas vaginalis, which is transmitted through sexual contact. Symptoms include inflammation of the cervix, urethra and vagina which produce an itching or burning sensation, and yellow-green, itchy, frothy foul-smelling vaginal discharge." ;
    :has_exact_synonym "urogenital trichomonas"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichomonas_tenax_trichomoniasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_fomite_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :oral_cavity ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :droplet_spread_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trichomonas_tenax ],
        :mouth_disease,
        :trichomoniasis ;
    :has_definition "A trichomoniasis that is caused by a singled-celled protozoan parasite Trichomonas tenax, which is transmitted through oral droplets, by kissing, or on fomites such as eating utensils. Trichomonas tenax causes periodonitis and bronchopulmonary trichomoniasis by aspiration from the oropharynx." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:basidiobolomycosis rdfs:subClassOf :subcutaneous_mycosis ;
    :has_definition "A subcutaneous mycosis that involves a chronic inflammatory or granulomatous fungal infection of the subcutaneous tissue of the limbs, chest, back or buttocks caused by Basidiobolus ranarum. Lesions appear as subcutaneous nodules which develop into massive, firm, indurated, painless swellings which are freely movable over the underlying muscle, but are attached to the skin which may become hyperpigmented but not ulcerated." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conidiobolomycosis rdfs:subClassOf :subcutaneous_mycosis ;
    :has_definition "An subcutaneous mycosis that is a chronic inflammatory or granulomatous fungal infection caused by Conidiobolus species, which is restricted to the nasal submucosa and characterized by polyps or palpable restricted subcutaneous masses. Symptoms include nasal obstruction, drainage and sinus pain. Subcutaneous nodules develop in the nasal and perinasal regions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:penicilliosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :talaromyces_marneffei ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :anemia ],
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that has_material_basis_in Penicillium marneffei, results_in systemic infection and has_symptom fever, has_symptom anemia, has_symptom weight loss, has_symptom lymphadenopathy, has_symptom hepatosplenomegaly, has_symptom respiratory signs, and has_symptom skin lesions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fusariosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that involves localized or hematogenously disseminated fungal infection by Fusarium solani or Fusarium oxysporum. Skin lesions are seen in neutropenic patients, and indolent cellulitis or soft-tissue necrosis occur in immunocompromised patients at the site of trauma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichosporonosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :trichosporon ],
        :opportunistic_mycosis ;
    :has_definition "An opportunistic mycosis that results_in disseminated infection, has_material_basis_in Trichosporon and results_in_formation_of nontender erythematous nodules anywhere on the body." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parasitic_ichthyosporea_infectious_disease rdfs:subClassOf :parasitic_infectious_disease ;
    :has_definition "A parasitic infectious disease that involves parasitic infection by the members of the class Ichthyosporea, which are parasites of fish and other animals." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_systemic_mycosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :fungi ],
        :systemic_mycosis ;
    :has_definition "A systemic mycosis that results_in infection located_in human body, has_material_basis_in Fungi, which can overcome the physiological and cellular defences of the normal human host. The primary deep pathogens usually gain access to the host via the respiratory tract." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aniseikonia rdfs:subClassOf :refractive_error ;
    :has_definition "A refractive error that is characterized by the significant difference in perceived sizes of an object between the two eyes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alkhurma_hemorrhagic_fever rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :thrombocytopenia ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :ornithodoros_savignyi ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :joint_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :alkhumra_hemorrhagic_fever_virus ],
        :kyasanur_forest_disease ;
    :has_definition "A viral infectious disease that is a hemorrhagic fever, has_material_basis_in Alkhurma hemorrhagic fever virus, which is transmitted by Ornithodoros savignyi tick bite, transmitted by ingestion of unpasteurized camel milk, or transmitted by entry via skin wound. The infection has symptom headache, has symptom joint pain, has symptom muscle pain, has symptom vomiting, has symptom thrombocytopenia, and has symptom hemorrhagic fever." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_hypothyroidism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :hypothyroidism,
        :physical_disorder ;
    :has_definition "A hypothyroidism that is present at birth." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lacrimoauriculodentodigital_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ladd_syndrome ;
    :has_definition "A syndrome that has_material_basis_in heterozygous mutation in the tyrosine kinase domain of the FGFR2 gene on chromosome 10q26 and that is characterized by autosomal dominant inheritance of abnormalities affecting the lacrimal and salivary glands and ducts, ears, teeth and fingers and toes." ;
    :has_exact_synonym "Lacrimo-auriculo-dento-digital syndrome 1",
        "LEVY-HOLLISTER SYNDROME"@en,
        "lacrimoauriculodentodigital syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:enlarged_vestibular_aqueduct rdfs:subClassOf :vestibular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :vestibular_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :vestibular_aqueduct ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A vestibular disease that is characterized by progressive hearing loss resulting from congenital enlargement of the vestibular aqueducts." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bradyopsia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :retinal_disease ;
    :has_definition "A retinal disease characterized by the slower than usual adaptation of the eyes to changing light conditions." ;
    :has_exact_synonym "prolonged electroretinal response suppression"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypophosphatemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :bone_pain ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :osteoarthritis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :hypophosphatemia ],
        :phosphorus_metabolism_disease ;
    :has_definition "A phosphorus metabolism disease that is characterized by hypophosphatemia and the symptoms of osteomalacia including bone pain, skeletal deformities and osteoarthritis." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_bacterial_infectious_disease rdfs:subClassOf :bacterial_infectious_disease ;
    :has_definition "A bacterial infectious disease that results_in infection by bacteria as a result of their presence or activity within the normal, healthy host, and their intrinsic virulence is, in part, a necessary consequence of their need to reproduce and spread." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:commensal_bacterial_infectious_disease rdfs:subClassOf :bacterial_infectious_disease ;
    :has_definition "A bacterial infectious disease that results_in infection by bacteria which are part of the normal human flora when one or more of the defense mechanisms designed to restrict them from the usually sterile internal tissues are breached by accident, by intent (surgery), or by an underlying metabolic or an infectious disorder." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opportunistic_bacterial_infectious_disease rdfs:subClassOf :bacterial_infectious_disease ;
    :has_definition "A bacterial infectious disease that results_in infection by bacteria in individuals whose host defense mechanisms have been compromised." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:foodborne_botulism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :double_vision ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :descending_muscle_paralysis ],
        :botulism ;
    :has_definition "A botulism that involves intoxication caused by botulinum neurotoxins (BoNTA, B, E and F), which are transmitted by ingestion of food contaminated with preformed toxins, has_material_basis_in Clostridium botulinum A, has_material_basis_in Clostridium botulinum B, has_material_basis_in Clostridium botulinum E and has_material_basis_in Clostridium botulinum F. The infection has symptom blurred vision, has symptom diplopia, has symptom dysarthria, has symptom dysphonia, has symptom dysphagia and has symptom descending muscle paralysis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wound_botulism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :contact_transmission ],
        :botulism ;
    :has_definition "A botulism that involves intoxication caused by botulinum neurotoxins (BoNTA, B, E and F), has_material_basis_in Clostridium botulinum A, has_material_basis_in Clostridium botulinum B, has_material_basis_in Clostridium botulinum E and has_material_basis_in Clostridium botulinum F, which are transmitted by contact of spores with the open wounds, which then reproduce in an anaerobic environment to produce toxins." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infant_botulism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vehicle_borne_ingestion_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :constipation ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ptosis ],
        :botulism ;
    :has_definition "A botulism that involves intoxication caused by botulinum neurotoxins (BoNTA or B) in infants, has_material_basis_in Clostridium botulinum A or has_material_basis_in Clostridium botulinum B, which are transmitted_by ingestion of bacterial spores, which then grow in the intestine and release toxins. The infection has_symptom constipation, has_symptom lethargy, has_symptom difficulty feeding, has_symptom swallowing, has_symptom ptosis, has_symptom loss of head control, and has_symptom muscle weakness." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glandular_tularemia rdfs:subClassOf :tularemia ;
    :has_definition "A tularemia that results_in swelling of regional lymph glands." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:typhoidal_tularemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :malaise ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :weight_loss ],
        :tularemia ;
    :has_definition "A tularemia that results_in bacteremia and has_symptom fever, has_symptom chills, has_symptom myalgia, has_symptom malaise, and has_symptom weight loss." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonpapillary_renal_cell_carcinoma rdfs:subClassOf :hereditary_renal_cell_carcinoma ;
    :has_definition "A hereditary renal cell carcinoma that has_material_basis_in a loss of 3p13-pter sequences." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carrion_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :bartonella_bacilliformis ],
        :bartonellosis ;
    :has_definition "A bartonellosis that results_in infection located_in endothelial cells or located_in red blood cells, has_material_basis_in Bartonella bacilliformis, which is transmitted_by sandflies of genus Lutzomyia. The infection has acute and chronic phases. The acute phase is characterized by severe hemolytic anemia and transient immunosuppression. The chronic phase is characterized by verruga peruana lesions which may ulcerate and bleed." ;
    :has_exact_synonym "Carrion disease"@en,
        "Oroya fever"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:complement_factor_i_deficiency rdfs:subClassOf :complement_deficiency ;
    :has_definition "A complement deficiency that is characterized by recurrent pyogenic bacterial infections that is the result of complement component 3 deficiency." ;
    :has_exact_synonym "C3 INACTIVATOR DEFICIENCY"@en,
        "COMPLEMENT COMPONENT 3 INACTIVATOR DEFICIENCY"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_adenomatous_polyposis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :intestinal_disease ;
    :has_definition "An intestinal disease that has_material_basis_in mutations in the APC gene and involves formation of numerous polyps in the epithelium of the large intestine which are initially benign and later transform into colon cancer." ;
    :has_exact_synonym "adenomatous polyposis of the colon"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:restless_legs_syndrome rdfs:subClassOf :central_nervous_system_disease ;
    :has_definition "A central nervous system disease characterized by throbbing, pulling creeping or other unpleasant sensations in the legs and the irresistible urge to move them." ;
    :has_exact_synonym "WED"@en,
        "Willis-Ekbom disease"@en,
        "Wittmaack-Ekbom syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stevens_johnson_syndrome rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease that is characterized by ulceration of less than 10 percent of the surface area of the body. The disease is often precipitated by the use of medications, such as antibiotics or antiepileptics, or onset of infection." ;
    :has_exact_match "MESH:D013262" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:xeroderma_pigmentosum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by a deficiency in the ability to repair ultraviolet damage that has_material_basis_in autosomal recessive inheritance of DNA repair." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonepidermolytic_palmoplantar_keratoderma rdfs:subClassOf :palmoplantar_keratosis ;
    :has_definition "A palmoplantar keratosis characterized by a well-demarcated, symmetric keratoderma located_in palms and located_in soles." ;
    :has_exact_synonym "Thost-Unna Syndrome"@en,
        "Unna-Thost Syndrome"@en,
        "diffuse nonepidermolytic palmomplantar keratoderma"@en,
        "tylosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hailey_hailey_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :pemphigus ;
    :has_definition "A pemphigus that is characterized by recurring blistering most commonly occurring in the folds of the skin and has_material_basis_in mutations in the ATP2C1 gene that result in loss of adhesion within the skin." ;
    :has_exact_synonym "BENIGN CHRONIC PEMPHIGUS"@en,
        "Pemphigus, Benign Familial"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_endocrine_neoplasia_type_2a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :multiple_endocrine_neoplasia ;
    :has_definition "A multiple endocrine neoplasia characterized by medullary carcinoma of the thyroid, pheochromocytoma, hyperparathyroidism, and occasionally cutaneous lichen amyloidosis." ;
    :has_exact_synonym "MEN2A"@en,
        "Sipple syndrome"@en,
        "multiple endocrine neoplasia II"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arrhythmogenic_right_ventricular_cardiomyopathy rdfs:subClassOf :intrinsic_cardiomyopathy ;
    :has_definition "An intrinsic cardiomyopathy that is characterized by hypokinetic areas involving the free wall of the right ventricle, with fibrofatty replacement of the right ventricular myocardium, with associated arrhythmias originating in the right ventricle and limited or no involvement of the left ventricle." ;
    :has_exact_synonym "ARVC"@en,
        "ARVC cardiomyopathy"@en,
        "ARVD"@en,
        "arrhythmogenic right ventricular cardiomyopathy"@en,
        "arrhythmogenic right ventricular dysplasia"@en,
        "arrhythmogenic right ventricular dysplasia/cardiomyopathy"@en,
        "right ventricular ACM"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:asperger_syndrome rdfs:subClassOf :autism_spectrum_disorder ;
    :has_definition "An autism spectrum disorder that is characterized by significant difficulties in social interaction, along with restricted and repetitive patterns of behavior and interests. It differs from other autism spectrum disorders by its relative preservation of linguistic and cognitive development." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fatal_familial_insomnia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hallucination ],
        :prion_disease ;
    :has_definition "A prion disease that is characterized by insomnia, hallucinations, dementia and death, located_in the brain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:andersen_tawil_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :arrhythmia ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :long_qt_syndrome ;
    :has_definition "A long QT syndrome that has_material_basis_in autosomal dominant inheritance of a mutation in the KCNJ2 gene which disrupts the rhythm of the heart's lower chambers (ventricular arrhythmia) and results_in an unusually small lower jaw (micrognathia), low-set ears, and an abnormal curvature of the fingers called clinodactyly." ;
    :has_exact_synonym "ANDERSEN CARDIODYSRHYTHMIC PERIODIC PARALYSIS"@en,
        "Andersen syndrome"@en,
        "LQT7"@en,
        "Long QT syndrome 7"@en,
        "Potassium-Sensitive Cardiodysrhythmic Type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mulibrey_nanism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by global growth retardation of the muscle, liver, brain and eyes as well as constrictive pericarditis and has_material_basis_in mutations in the TRIM37 gene." ;
    :has_exact_synonym "MUL"@en,
        "Mulibrey growth disorder"@en,
        "Muscle-Liver-Brain-Eye Nanism"@en,
        "PERICARDIAL CONSTRICTION AND GROWTH FAILURE"@en,
        "Perheentupa Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:danon_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :lysosomal_storage_disease,
        :x_linked_dominant_disease ;
    :has_definition "A lysosomal storage disease that is characterized by cardiomyopathy, skeletal myopathy and intellectual disability and has_material_basis_in mutations in the LAMP2 gene." ;
    :has_exact_synonym "ANTOPOL DISEASE"@en,
        "PSEUDOGLYCOGENOSIS II"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:frasier_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by gonadal dysgenesis, streak gonads, progressive focal segmental glomerulonephropathy and the development of urogenital cancers that is the result of mutation in the WT1 gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:usher_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by a combination of hearing loss and visual impairment." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_partial_lipodystrophy rdfs:subClassOf :partial_lipodystrophy ;
    :has_definition "A partial lipodystrophy characterized by abnormal subcutaneous adipose tissue distribution beginning in late childhood or early adult life." ;
    :has_exact_synonym "Dunnigan Syndrome"@en,
        "Koberling-Dunnigan Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucosulfatidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :sphingolipidosis ;
    :has_definition "A sphingolipidosis that is characterized by leukodystrophy, ichthyosis, skeletal abnormalities and shortened life expectancy and has_material_basis_in mutation in the SUMF1 gene that results in deficiency in multiple sulfatase enzymes." ;
    :has_exact_synonym "Sulfatidosis, Juvenile, Austin Type"@en,
        "multiple sulfatase deficiency disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infantile_refsum_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        :peroxisomal_disease ;
    :has_definition "A peroxisomal disease that is characterized by neurological impairment, intellectual disability, hepatosplenomegaly and ichthyosis and results from the accumulation of very long chain fatty acids and phytanic acid, secondary to mutation in the PEX genes." ;
    :has_exact_synonym "infantile phytanic acid storage disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_dominant_hypophosphatemic_rickets rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_dominant_inheritance ],
        :rickets,
        :x_linked_dominant_disease ;
    :has_definition "A rickets has_material_basis_in X-linked mutations in the PHEX gene that lead to increased circulating levels of FGF-23, a phosphate-regulating hormone (phosphatonin), that leads to reduced renal phosphate reabsorption and consequently abnormal bone mineralization." ;
    :has_exact_synonym "Hypophosphatemia, Vitamin D-Resistant Rickets"@en,
        "Vitamin D-Resistant Rickets, X-Linked"@en,
        "X-linked hypophosphatemia"@en,
        "hypophosphatemic rickets X-linked dominant"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:white_sponge_nevus rdfs:subClassOf :skin_disease ;
    :has_definition "A skin disease characterized by a defect in the normal process of keratinization of the mucosa." ;
    :has_exact_synonym "hereditary mucosal leukokeratosis"@en,
        "white sponge nevus of Cannon"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pachyonychia_congenita rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by hypertrophic nails and hyperkeratosis of the hands and feet and has_material_basis_in gene mutations that result in changes in keratin." ;
    :has_exact_synonym "Jackson-Lawler Type Pachyonychia Congenita"@en,
        "Jadassohn-Lewandowsky Syndrome"@en,
        "PACHYONYCHIA CONGENITA, JADASSOHN-LEWANDOWSKY TYPE"@en,
        "Pachyonychia Congenita Type 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gitelman_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :renal_tubular_transport_disease ;
    :has_definition "A renal tubular transport disease that is has_material_basis_in mutations in genes that produce proteins involved in the kidneys' reabsorption of salt (sodium chloride or NaCl) from urine back into the bloodstream, thus impairing the kidneys' ability to reabsorb salt, leading to the loss of excess salt in the urine (salt wasting)." ;
    :has_exact_synonym "HYPOMAGNESEMIA-HYPOKALEMIA, PRIMARY RENOTUBULAR, WITH HYPOCALCIURIA"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brugada_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :heart_conduction_disease,
        :monogenic_disease ;
    :has_definition "A heart conduction disease that is characterized by abnormal electrocardiogram (ECG) findings and an increased risk of sudden cardiac death." ;
    :has_exact_synonym "Bangungut"@en,
        "Brugada type idiopathic ventricular fibrillation"@en,
        "Dream disease"@en,
        "Pokkuri death syndrome"@en,
        "SUNDS"@en,
        "sudden unexplained nocturnal death syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mevalonic_aciduria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :peroxisomal_disease ;
    :has_definition "A peroxisomal disease that is characterized by cortical atrophy, microcephaly, dysmorphic facies, muscular hypotonia and intellectual disability and has_material_basis_in mutation in the MVK gene that results in deficiency of mevalonate kinase and impaired cholesterol. biosynthesis." ;
    :has_exact_synonym "Mevalonate Kinase Deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lissencephaly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebral_cortex ],
        :congenital_nervous_system_abnormality ;
    :has_definition "A congenital nervous system abnormality characterized by the absence of folds in the cerebral cortex and caused_by defective neuronal migration during the 12th to 24th weeks of gestation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:periventricular_nodular_heterotopia rdfs:subClassOf :congenital_nervous_system_abnormality ;
    :has_definition "A congenital nervous system abnormality characterized by non proper migration of neurons during the early development of the fetal brain." ;
    :has_exact_synonym "periventricular heterotopia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:buruli_ulcer_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :skin_lesion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :mycobacterium_ulcerans ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :necrosis ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :vector_borne_transmission ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease that results_in infection located_in skin or located_in subcutaneous tissue, has_material_basis_in Mycobacterium ulcerans, which could be transmitted_by insects. The bacterium produces a toxin, named mycolactone, which causes subcutaneous fat necrosis and inhibits an immune response. The infection has_symptom nodule, which is a painless, mobile swelling in the skin." ;
    :has_exact_synonym "Bairnsdale ulcer"@en,
        "Daintree ulcer"@en,
        "Mossman ulcer"@en,
        "Searl ulcer"@en,
        "Searle's ulcer"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sertoli_cell_only_syndrome rdfs:subClassOf :male_infertility ;
    :has_definition "A male infertility disease characterized by male sterility, has_material_basis_in azospermia without abnormal sexual development." ;
    :has_exact_synonym "DEL CASTILLO SYNDROME"@en,
        "Germinal Cell Aplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_myelomonocytic_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        :myelodysplastic_myeloproliferative_neoplasm ;
    :has_definition "A myelodysplastic/myeloproliferative neoplasm that is characterized by the uncontrolled growth of monocytes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hyperphosphatemia rdfs:subClassOf :phosphorus_metabolism_disease ;
    :has_definition "A phosphorus metabolism disease characterized by hyperphosphatemia and abnormal deposits of phosphate and calcium in joints and soft tissues, results from abnormal phosphorus metabolism and has_material_basis_in mutations in the FGF23, GALNT3 or KL gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wolf_hirschhorn_syndrome rdfs:subClassOf :chromosomal_deletion_syndrome ;
    :has_definition "A chromosomal deletion syndrome that is characterized by distinct craniofacial features, hypotonia and intellectual disability and has_material_basis_in a hemizygous deletion of chromosome 4p16.3." ;
    :has_exact_synonym "4p deletion syndrome"@en,
        "PITT SYNDROME"@en,
        "Pitt-Rogers-Danks Syndrome"@en,
        "chromosome 4p16.3 deletion syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aspartylglucosaminuria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :lysosomal_storage_disease ;
    :has_definition "A lysosomal storage disease that is characterized by delayed speech at 2-3 years of age, has_material_basis_in mutations in the AGA gene that result in the absence or shortage of the aspartylglucosaminidase enzyme in lysosomes, preventing the normal breakdown of glycoproteins." ;
    :has_exact_match "MESH:D054880" ;
    :has_exact_synonym "aspartylglucosaminidase deficiency"@en,
        "aspartylglycosaminuria"@en,
        "glycosylasparaginase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:antley_bixler_syndrome_with_disordered_steroidogenesis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :symptom ],
        :antley_bixler_syndrome,
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "An Antley-Bixler syndrome that is characterized at birth or prenatally by malformations and deformities affecting the majority of the skeleton and other areas of the body with autosomal recessive inheritance of the FGFR2 gene." ;
    :has_exact_match "MESH:D054882" ;
    :has_exact_synonym "trapezoidocephaly-synostosis syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:campomelic_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that has_material_basis_in heterozygous mutation in the SOX9 gene on chromosome 17q24 and that is characterized by congenital shortness and bowing of long tubular bones, especially in the lower extremities, as well as by hypoplastic scapulae, narrow iliac wings, and nonmineralized thoracic pedicles." ;
    :has_exact_synonym "Acampomelic Campomelic Dysplasia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:farber_lipogranulomatosis rdfs:subClassOf :lipid_storage_disease ;
    :has_definition "A lipid storage disease that is characterized by abnormalities in swallowing, cognition, joint function, and central nervous system due to a deficiency in the enzyme ceramidase that results in sphingolipids deposition." ;
    :has_exact_synonym "Farber disease"@en,
        "N-laurylsphingosine deacylase deficiency"@en,
        "acid ceramidase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:muir_torre_syndrome rdfs:subClassOf :lynch_syndrome ;
    :has_definition "A Lynch syndrome that is characterized by a propensity to develop cancers of the gastrointestinal tract, genitourinary tract, and skin that has_material_basis_in mutations in DNA mismatch repair genes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:loeys_dietz_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by increased risk of aortic aneurysm and dissection, elongated limbs, hypertelorism, bifid uvula and easy skin bruising due to mutations in TGFB3 that results in connective tissue defects." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erythrokeratodermia_variabilis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :skin_disease ;
    :has_definition "A skin disease that is characterized by areas of sharply demarcated, brown hyperkeratosis and has_material_basis_in mutations in genes encoding for connexin channels proteins in the epidermis." ;
    :has_exact_match "MESH:D056266" ;
    :has_exact_synonym "Erythrokeratodermia Figurata Variabilis"@en,
        "Greither Disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:yellow_nail_syndrome rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :zone_of_skin ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :nail ] ;
                            rdf:rest :nil ] ] ],
        :nail_disease,
        :skin_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by an accumulation of protein-rich fluid (lymph) in the soft layers of tissue under the skin resulting in pleural effusions, lymphedema (due to lymphatic hypoplasia) and yellow dystrophic nails hat lack a cuticle, grow slowly, and are loose or detached." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:costello_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ra_sopathy ;
    :has_definition "A RASopathy characterized by craniofacial dysmorphology, cardiac defects, mild mental retardation, and high birth weight followed by a failure to thrive and developmental delays." ;
    :has_exact_synonym "FCS SYNDROME"@en,
        "Faciocutaneoskeletal Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:donohue_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by protuberant and low-set ears, flaring nostrils, thick lips, enlarged secondary sex organs and overwhelming insulin resistance and has_material_basis_in mutation within the INSR gene causing abnormalities in the insulin receptor." ;
    :has_exact_synonym "Leprechaunism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carney_complex rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by myxomas, spotty pigmentation of the skin and endocrine overactivity." ;
    :has_exact_synonym "Carney Complex, Type 1"@en,
        "Carney Complex, Type 2"@en,
        "Carney Syndrome"@en,
        "Carney complex variant"@en,
        "LAMB Syndrome"@en,
        "NAME Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monilethrix rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :hair_disease ;
    :has_definition "A hair disease that is characterized by short, easily broken hair that results in alopecia and has_material_basis_in mutations in genes for type II hair cortex keratins." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alstrom_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :blindness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by multiorgan dysfunction. The key features are childhood obesity, blindness due to congenital retinal dystrophy, and sensorineural hearing loss with autosomal recessive inheritance and has_material_basis_in mutations in the ALMS1 gene." ;
    :has_exact_match "MESH:D056769" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:netherton_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :inflammation ],
        :autosomal_recessive_disease,
        :skin_disease ;
    :has_definition "A skin disease that is characterized by chronic skin inflammation, trichorrhexis invaginata, atopic dermatitis and has_material_basis_in mutations in the SPINK5 gene resulting in reduced capacity to inhibit serine proteases expressed in the skin." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:weill_marchesani_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by short stature, brachycephaly and other facial abnormalities, brachydactyly, joint stiffness and distinctive ocular abnormalities." ;
    :has_exact_synonym "GEMSS syndrome"@en,
        "Marchesani-Weill Syndrome"@en,
        "Mesodermal Dysmorphodystrophy, Congenital"@en,
        "Spherophakia Brachymorphia Syndrome"@en,
        "congenital mesodermal dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:barth_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :3_methylglutaconic_aciduria,
        :x_linked_recessive_disease ;
    :has_definition "A 3-methylglutaconic aciduria that has_material_basis_in X-linked inheritance of the tafazzin gene and is characterized by decreased production of an enzyme required to produce cardiolipin." ;
    :has_exact_match "MESH:D056889" ;
    :has_exact_synonym "3-methylglutaconicaciduria type 2"@en,
        "3-methylglutaconicaciduria type II"@en,
        "MGA Type 2"@en,
        "MGA type II"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liddle_syndrome rdfs:subClassOf :renal_tubular_transport_disease ;
    :has_definition "A renal tubular transport disease that is characterized by hypertension and hypokalemia caused by dysregulation of epithelial sodium channels causing over expression of the channel." ;
    :has_exact_synonym "Liddle's syndrome"@en,
        "Pseudoaldosteronism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epidemic_typhus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :photophobia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :insect_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :stupor ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :high_fever ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :pediculus_humanus_corporis ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :rickettsia_prowazekii ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :delirium ],
        :typhus ;
    :has_definition "A typhus that has_material_basis_in Rickettsia prowazekii, which is transmitted by human body louse (Pediculus humanus corporis). The infection has_symptom high fever, has_symptom cough, has_symptom rash, has_symptom severe muscle pain, has_symptom chills, has_symptom falling blood pressure, has_symptom stupor, has_symptom sensitivity to light, and has_symptom delirium." ;
    :has_exact_synonym "sylvatic typhus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endemic_typhus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nausea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :headache ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :chills ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :rickettsia_felis ;
                            rdf:rest [ rdf:first :rickettsia_typhi ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :xenopsylla_cheopis ],
        [ a owl:Restriction ;
            owl:onProperty :transmitted_by ;
            owl:someValuesFrom :flea_borne_transmission ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rash ],
        :typhus ;
    :has_definition "A typhus that has_material_basis_in Rickettsia typhi or has_material_basis_in Rickettsia felis, which are transmitted by fleas (Xenopsylla cheopis). The infection has symptom headache, has symptom fever, has symptom chills, has symptom myalgia, has symptom nausea, has symptom vomiting, has symptom cough and has symptom rash." ;
