@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_spinal_muscular_atrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :autosomal_recessive_disease,
        :spinal_muscular_atrophy ;
    :has_definition "A spinal muscular atrophy that is characterized by progressive muscular weakness and motor disability that typically presents in the third decade of life and has_material_basis_in mutations in the SMN1 or SMN2 genes that are required for the survival of motor neurons." ;
    :has_exact_synonym "SMA4"@en,
        "SPINAL MUSCULAR ATROPHY, ADULT FORM"@en,
        "SPINAL MUSCULAR ATROPHY, TYPE IV"@en,
        "spinal muscular atrophy 4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermediate_spinal_muscular_atrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        :autosomal_recessive_disease,
        :childhood_spinal_muscular_atrophy ;
    :has_definition "A childhood spinal muscular atrophy that is characterized by progressive muscular weakness and respiratory failure, develops in children between the ages of 6 and 12 months and drastically reduces length of life, and has_material_basis_in mutations in the SMN1 or SMN2 genes that are required for the survival of motor neurons." ;
    :has_exact_synonym "MUSCULAR ATROPHY, SPINAL, INFANTILE CHRONIC FORM"@en,
        "MUSCULAR ATROPHY, SPINAL, INTERMEDIATE TYPE"@en,
        "SMA II"@en,
        "SMA2"@en,
        "spinal muscular atrophy 2"@en,
        "spinal muscular atrophy type II"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_stationary_night_blindness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :hereditary_night_blindness,
        :physical_disorder ;
    :has_definition "A hereditary night blindness that is characterized by hemeralopia with a moderate loss of visual acuity and caused by defective photoreceptor-to-bipolar cell signaling with common ERG findings of reduced or absent b-waves and generally normal a-waves." ;
    :has_exact_synonym "congenital essential nyctalopia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exudative_vitreoretinopathy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hemorrhage ],
        :retinal_vascular_disease ;
    :has_definition "A retinal vascular disease characterized by the prevention of blood vessel formation at the edges of the retina and the hemorrhage of the blood vessels in the retina." ;
    :has_exact_synonym "FEVR"@en,
        "familial exudative vitreoretinopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:posterior_polar_cataract rdfs:subClassOf :cataract ;
    :has_definition "A cataract that is characterized by a distinctive discoid lens opacity situated posteriorly and adjacent to the posterior capsule." ;
    :has_exact_synonym "CATARACT, POSTERIOR POLAR"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_1 rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease characterized by demyelination of the peripheral nerve axons." ;
    :has_exact_synonym "hereditary motor and sensory neuropathy type 1"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_2 rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease characterized by abnormalities in the axon of the peripheral nerve cell." ;
    :has_exact_synonym "hereditary motor and sensory neuropathy Guadalajara neuronal type"@en,
        "hereditary motor and sensory neuropathy Okinawa type"@en,
        "hereditary motor and sensory neuropathy type 2"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease that is characterized by motor and sensory peripheral neuropathies caused by demyelination." ;
    :has_exact_synonym "DEJERINE-SOTTAS NEUROPATHY"@en,
        "DEJERINE-SOTTAS SYNDROME"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_4 rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease characterized by demyelinating or axonal abnormalities that has_material_basis_in autosomal recessive inheritance." ;
    :has_exact_synonym "hereditary motor and sensory neuropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_type_x rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease that has_material_basis_in X-linked inheritance of a point mutation in the connexin-32 gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:charcot_marie_tooth_disease_intermediate_type rdfs:subClassOf :charcot_marie_tooth_disease ;
    :has_definition "A Charcot-Marie-Tooth disease characterized by motor conduction velocities above and below 38 m/s." ;
    :has_exact_synonym "Charcot-Marie-Tooth disease dominant intermediate"@en,
        "Charcot-Marie-Tooth disease recessive intermediate"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypermethioninemia rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that involves an excess of the amino acid methionine, in the blood. This condition can occur when methionine is not broken down properly in the body." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:visceral_heterotaxy rdfs:subClassOf :physical_disorder ;
    :has_definition "A physical disorder characterized by the abnormal distribution of the major visceral organs within the chest and abdomen." ;
    :has_exact_synonym "heterotaxia"@en,
        "situs ambiguus"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_adrenal_insufficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :adrenal_gland_disease,
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :physical_disorder ;
    :has_definition "An adrenal gland disease that is characterized by cortisol deficiency, hypoaldosteronism and excessive or insufficient sex hormones, has_material_basis_in the mutation in the gene for 21-hydroxylase, 11beta-hydroxylase, 3beta-hydroxysteroid, 17alpha-hydroxylase or 20,22-desmolase." ;
    :has_exact_synonym "Adrenal insufficiency, congenital, with 46,XY sex reversal",
        "ADRENAL INSUFFICIENCY, CONGENITAL, WITH 46,XY SEX REVERSAL, PARTIAL OR COMPLETE"@en,
        "P450scc DEFICIENCY"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_medullary_thyroid_carcinoma rdfs:subClassOf :thyroid_gland_medullary_carcinoma ;
    :has_definition "A thyroid gland medullary carcinoma that has_material_basis_in autosomal dominant inheritance." ;
    :has_exact_synonym "THYROID CARCINOMA, FAMILIAL MEDULLARY"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_sensory_neuropathy rdfs:subClassOf :neuropathy ;
    :has_definition "A neuropathy characterized by congenital insensitivity to pain resulting in ulceration to the fingers, tongue, lips, and other distal appendages." ;
    :has_exact_synonym "familial dysautonomia, type II"@en,
        "hereditary sensory and autonomic neuropathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:saldino_noonan_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :heart_failure ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by congenital heart defects, failure to thrive, short stature, cognitive dysfunction, pectus excavatum, coagulation defects and craniofacial defects and that has_material_basis_in the mutation in the Ras/mitogen activated protein kinase." ;
    :has_exact_synonym "type I short rib polydactyly syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:proteasome_associated_autoinflammatory_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :digenic_disease,
        :proteosome_associated_autoinflammatory_syndrome ;
    :has_definition "A proteasome-associated autoinflammatory syndrome that is characterized by early childhood onset of annular erythematous plaques on the face and extremities with subsequent development of partial lipodystrophy and laboratory evidence of immune dysregulation and that has_material_basis_in homozygous mutation in the PSMB8 gene on chromosome 6p21 or a heterozygous mutation in the PSMB8 gene and a heterozygous mutation in either the PSMA3 gene on chromosome 14q23 or in the PSMB4 gene on chromosome 1q21." ;
    :has_exact_synonym "CANDLE",
        "NKJO",
        "Nakajo-Nishimura syndrome",
        "PRAAS1",
        "chronic atypical neutrophilic dermatosis with lipodystrophy and elevated temperature syndrome",
        "JMP syndrome"@en,
        "JOINT CONTRACTURES, MUSCULAR ATROPHY, MICROCYTIC ANEMIA, AND PANNICULITIS-INDUCED LIPODYSTROPHY"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_sideroblastic_anemia_with_ataxia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :sideroblastic_anemia,
        :x_linked_recessive_disease ;
    :has_definition "A sideroblastic anemia that is characterized by decreased production of hemoglobin and ataxia and has_material_basis_in the mutation in the ABCB7 gene." ;
    :has_exact_synonym "Anemia, sideroblastic, spinocerebellar ataxia",
        "Anemia sideroblastic and spinocerebellar ataxia"@en,
        "X-linked sideroblastic anaemia and ataxia"@en,
        "X-linked sideroblastic anaemia with ataxia"@en,
        "X-linked sideroblastic anemia and ataxia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_muscular_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :progressive_weakness ],
        :muscular_dystrophy,
        :physical_disorder ;
    :has_definition "A muscular dystrophy that is characterized by diminished muscle tone (hypotonia), progressive muscle weakness and degeneration (atrophy), abnormally fixed joints, spinal rigidity, and delays in reaching motor milestones such as sitting or standing unassisted." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ullrich_congenital_muscular_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :autosomal_recessive_disease,
        :congenital_muscular_dystrophy ;
    :has_definition "A congenital muscular dystrophy that is characterized by muscle weakness and respiratory depression and has_material_basis_in mutation in the COL6A1, COL6A2 and COL6A3 that produce components of type VI collagen." ;
    :has_exact_synonym "ULLRICH DISEASE"@en,
        "Ullrich scleroatonic muscular dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fukuyama_congenital_muscular_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :congenital_muscular_dystrophy_dystroglycanopathy_type_a ;
    :has_definition "A congenital muscular dystrophy-dystroglycanopathy type A that is characterized by muscle weakness, failure to thrive, severe intellectual and developmental disability, impaired vision and cardiac abnormalities and has_material_basis_in mutation in the FKTN gene that produces the fukutin protein." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:walker_warburg_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :congenital_muscular_dystrophy ;
    :has_definition "A congenital muscular dystrophy that is characterized by hypotonia, seizures, severe intellectual and developmental disability, eye abnormalities and early death and has_material_basis_in mutations in multiple genes including POMT1, POMT2, ISPD, FKTN, FKRP, and LARGE1." ;
    :has_exact_synonym "HARD syndrome"@en,
        "cerebroocular dysplasia-muscular dystrophy syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lennox_gastaut_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_electroclinical_syndrome ;
    :has_definition "A childhood electroclinical syndrome that is characterized by frequent seizures and intellectual disability that present in early childhood." ;
    :has_exact_synonym "Lennox syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:west_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :infancy_electroclinical_syndrome ;
    :has_definition "An infancy electroclinical syndrome that is characterized by infantile spasms, hypsarrhythmia on electroencephalogram and intellectual disability." ;
    :has_related_synonym "Infantile spasms syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nonsyndromic_deafness rdfs:subClassOf :auditory_system_disease ;
    :has_definition "An auditory system disease that is associated with permanent hearing loss caused by damage to structures in the inner ear and/or the middle ear, which is not associated with other signs and symptoms." ;
    :has_exact_synonym "nonsyndromic hearing loss"@en,
        "nonsyndromic hereditary hearing loss"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_nonsyndromic_deafness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :nonsyndromic_deafness ;
    :has_definition "A nonsyndromic deafness characterized by an autosomal dominant inheritance mode." ;
    :has_exact_synonym "autosomal dominant deafness"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_nonsyndromic_deafness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :nonsyndromic_deafness ;
    :has_definition "A nonsyndromic deafness characterized by an autosomal recessive inheritance mode." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_nonsyndromic_deafness rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_inheritance ],
        :nonsyndromic_deafness,
        :x_linked_monogenic_disease ;
    :has_definition "A nonsyndromic deafness characterized by an X-linked inheritance mode." ;
    :has_exact_synonym "X-linked deafness"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orofacial_cleft rdfs:subClassOf [ owl:intersectionOf [ rdf:first :physical_disorder ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_basis_in ;
                                    owl:someValuesFrom :symptom ] ;
                            rdf:rest :nil ] ] ],
        [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :disease_has_location ;
                            owl:someValuesFrom :soft_palate ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :lip ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :hard_palate ] ;
                                    rdf:rest :nil ] ] ] ],
        :physical_disorder,
        :syndrome ;
    :has_definition "A physical disorder that is characterized by cleft lip and/or cleft palate that result in feeding, speech and hearing problems caused by failures during development." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spondylocostal_dysostosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        :dysostosis,
        :spinal_disease ;
    :has_definition "A dysostosis that results_in abnormal development located_in vertebrae or located_in ribs. The bones of the spine do not develop properly, which causes them to be misshapen and abnormally joined together." ;
    :has_exact_synonym "Jarcho-Levin syndrome"@en,
        "costovertebral dysplasia"@en,
        "spondylothoracic dysostosis"@en,
        "spondylothoracic dysplasia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:seckel_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by intrauterine growth retardation and postnatal dwarfism with microcephaly and intellectual disability." ;
    :has_exact_synonym "Harper's syndrome"@en,
        "Virchow-Seckel dwarfism"@en,
        "bird-headed dwarfism"@en,
        "microcephalic primordial dwarfism"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_disorder_of_glycosylation_type_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :congenital_disorder_of_glycosylation ;
    :has_definition "A congenital disorder of glycosylation characterized by under-glycosylated serum glycoproteins." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_disorder_of_glycosylation_type_ii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :congenital_disorder_of_glycosylation ;
    :has_definition "A congenital disorder of glycosylation that involves malfunctioning trimming or processing of the protein-bound oligosaccharide chain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cone_rod_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :retinal_degeneration ;
    :has_definition "A retinal degeneration that characterized by progressive deterioration of the cone and rod photoreceptor cells." ;
    :has_exact_synonym "cone-rod retinal dystrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:2_hydroxyglutaric_aciduria rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that is an autosomal recessive neurometabolic disorder characterized by the significant elevation of urinary levels of hydroxyglutaric acid causing progressive brain damage." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:l_2_hydroxyglutaric_aciduria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebellum ],
        :2_hydroxyglutaric_aciduria,
        :cerebellar_disease ;
    :has_definition "An 2-hydroxyglutaric aciduria that involves damage to cerebellum affecting movement coordination resulting in problems with balance and muscle coordination (ataxia)." ;
    :has_exact_synonym "L-2-HYDROXYGLUTARIC ACIDEMIA"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:d_2_hydroxyglutaric_aciduria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        :2_hydroxyglutaric_aciduria ;
    :has_definition "An 2-hydroxyglutaric aciduria that involves developmental delay, seizures, weak muscle tone (hypotonia), and abnormalities in the largest part of the brain (the cerebrum), which controls many important functions such as muscle movement, speech, vision, thinking, emotion, and memory." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:senior_loken_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by progressive wasting of the filtering unit of the kidney (nephronophthisis), with or without medullary cystic renal disease, and progressive eye disease." ;
    :has_exact_synonym "Loken Senior syndrome"@en,
        "renal-retinal syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranioectodermal_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by characterized by sagittal craniosynostosis and facial, ectodermal, and skeletal anomalies." ;
    :has_exact_synonym "Sensenbrenner syndrome",
        "Levin syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:occult_macular_dystrophy rdfs:subClassOf :macular_degeneration ;
    :has_definition "A macular degeneration that is characterized by a central cone dysfunction leading to a loss of vision with a normal fundus and normal fluorescein angiography findings." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_storage_disease_xv rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :glycogen_storage_disease ;
    :has_definition "A glycogen storage disease characterized by muscle weakness and cardiac abnormalities caused and has_material_basis_in mutation in the GYG1 gene that encodes glycogenin-1." ;
    :has_exact_synonym "Glycogen storage disease 15",
        "Glycogen storage disease with severe cardiomyopathy due to glycogenin deficiency",
        "glycogen storage disease type XV"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hereditary_lymphedema rdfs:subClassOf :lymphedema ;
    :has_definition "A lymphedema commonly located_in legs, caused_by congenital abnormalities in the lymphatic system." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_digit_morphology ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :foot ;
                            rdf:rest [ rdf:first :finger ;
                                    rdf:rest :nil ] ] ] ],
        :dysostosis ;
    :has_definition "A dysostosis characterized by short fingers and toes." ;
    :has_exact_match "MESH:D059327" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gummatous_syphilis rdfs:subClassOf :tertiary_syphilis ;
    :has_definition "A tertiary syphilis that is characterized by granulomatous lesions, called gummas, which are characterized by a center of necrotic tissue with a rubbery texture. They form in the liver, bones, and testes but may affect any organ." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_generalized_lipodystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :autosomal_recessive_disease,
        :complete_generalized_lipodystrophy,
        :physical_disorder ;
    :has_definition "A lipodystrophy that is characterized by extreme scarcity of subcutaneous fat, muscular hypertrophy, fatty liver, hypertriglyceremia and metabolic complications including insulin resistance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trichotillomania rdfs:subClassOf :impulse_control_disorder ;
    :has_definition "An impulse control disorder that involves the uncontrollable plucking of ones hair." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:muscular_dystrophy_dystroglycanopathy_type_b1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :muscular_dystrophy_dystroglycanopathy_type_b ;
    :has_definition "A congenital muscular dystrophy characterized by muscle weakness, cognitive impairment and brain abnormalities and has_material_basis_in mutation to the POMT1 gene that encodes O-mannosyltransferase." ;
    :has_exact_synonym "Muscular dystrophy-dystroglycanopathy congenital with impaired intellectual development B1",
        "CMD due to dystroglycanopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:inflammatory_bowel_disease rdfs:subClassOf :intestinal_disease ;
    :has_definition "An intestinal disease characterized by inflammation located in all parts of digestive tract." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:severe_congenital_neutropenia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :neutropenia,
        :physical_disorder ;
    :has_definition "A neutropenia characterized by a maturation arrest of granulopoiesis at the level or promyelocytes and early onset of severe bacterial infections." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tooth_agenesis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :tooth_agenesis ],
        :tooth_disease ;
    :has_definition "A tooth disease characterized by failure to develop one or more missing teeth." ;
    :has_exact_synonym "familial tooth agenesis"@en,
        "hypodontia"@en,
        "oligodontia"@en,
        "selective tooth agenesis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:asphyxiating_thoracic_dystrophy rdfs:subClassOf :bone_development_disease ;
    :has_definition "A bone development disease characterized by skeletal abnormalities and resulting in difficulty in breathing caused by mutations that result in ciliopathy." ;
    :has_exact_synonym "Jeune syndrome"@en,
        "short-rib thoracic dysplasia with or without polydactyly"@en,
        "thoracic pelvic phalangeal dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_congenital_glaucoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :glaucoma,
        :monogenic_disease,
        :physical_disorder ;
    :has_definition "A glaucoma that is characterized by damage to the optic nerves that reduces peripheral vision and leads to blindness, has_material_basis_in mutation in the MYOC gene and appears before the age of 5 without other associated abnormalities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_storage_disease_ix rdfs:subClassOf :glycogen_storage_disease ;
    :has_definition "A glycogen storage disease characterized by deficiency of hepatic phosphorylase kinase activity." ;
    :has_exact_synonym "Glycogen storage disease 9" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:taeniasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :taenia_saginata ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :taenia_solium ],
        :parasitic_helminthiasis_infectious_disease ;
    :has_definition "A parasitic helminthiasis infectious disease that has_material_basis_in Taenia solium or has_material_basis_in Taenia saginata, which are transmitted by ingestion of undercooked contaminated meat." ;
    :has_related_synonym "Beef tapeworm infection"@en,
        "Infection by Taeniarhynchus saginatus"@en,
        "Taenia saginata infectious disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_schistosomiasis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hepatosplenomegaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :fever ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_pain ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :rectorrhagia ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :intestine ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :hematochezia ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :eosinophilia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :cough ],
        :intestinal_disease,
        :schistosomiasis ;
    :has_definition "A schistosomiasis that involves parasitic infection of the intestine caused by Schistosoma mansoni, Schistosoma intercalatum or Schistosomiasis japonicum. The symptoms include fever, cough, abdominal pain, diarrhea, hepatosplenomegaly, colonic polyposis with bloody diarrhea and eosinophilia." ;
    :has_exact_synonym "Katayama fever"@en,
        "Schistosoma japonicum infection"@en,
        "Schistosoma mansoni infectious disease"@en,
        "schistosomiasis japonica"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extrapulmonary_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :genitourinary_system ],
        :tuberculosis ;
    :has_definition "A tuberculosis that occurs at body sites other than the lung." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abdominal_tuberculosis rdfs:subClassOf :extrapulmonary_tuberculosis ;
    :has_definition "An extrapulmonary tuberculosis that is located_in gastrointestinal tract, located_in peritoneum, located_in omentum, located_in mesentery, located_in liver, located_in spleen or located_in pancreas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abcd_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by albinism, black lock, cell migration disorder of the neurocytes of the gut and sensorineural deafness and has_material_basis_in a mutation in the endothelin B receptor gene (EDNRB)." ;
    :has_exact_synonym "ABCDS"@en,
        "albinism, black lock, cell migration disorder of the neurocytes of the gut, and deafness"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by light pigmentation with excessive freckling, sparse hair involving the scalp and axilla, lacrimal duct stenosis or atresia, onychodysplasia, hypodontia or early loss of permanent teeth, athelia or hypoplastic nipples, and breast hypoplasia, has_material_basis_in a mutation in TP63." ;
    :has_exact_synonym "acro-dermato-ungual-lacrimal-tooth syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:triple_a_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by achalasia, adrenal insufficiency and alacrima and has_material_basis_in mutations in the AAAS gene that encodes ALADIN within the nuclear envelope and results in dysfunction of the autonomic nervous system." ;
    :has_exact_synonym "AAAS"@en,
        "Achalasia-Addisonianism-Alacrimia syndrome"@en,
        "Allgrove Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acheiropody rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia characterized by a lack of formation of the distal extremities has_material_basis_in mutation in the LMBR1 gene." ;
    :has_exact_synonym "Acheiropodia"@en,
        "Horn-Kolb Syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acrocapitofemoral_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia characterized by skeletal dysplasia, bradydactyly and narrow thorax and has_material_basis_in mutations in the Indian hedgehog homolog gene." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acrodermatitis_enteropathica rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :metal_metabolism_disorder ;
    :has_definition "A metal metabolism disorder characterized by dermatitis around bodily openings and the tips of fingers and toes, alopecia and diarrhea and has_material_basis_in mutation in the SLC39A4 gene that encodes a zinc uptake protein and results in zinc deficiency." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acrokeratosis_verruciformis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :keratosis ;
    :has_definition "A keratosis that has_material_basis_in mutations in the ATP2A2 gene." ;
    :has_exact_synonym "Acrokeratosis verruciformis of Hopf"@en,
        "Hopf disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:askin_s_tumor rdfs:subClassOf :ewing_sarcoma ;
    :has_definition "An Ewing sarcoma that arises from the soft tissues of the chest wall that tend to recur locally and not widely disseminated." ;
    :has_exact_synonym "Askin tumor"@en,
        "Askin tumour"@en,
        "Askin's tumour"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oral_cavity_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma,
        :mouth_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :oral_cavity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma of the oral cavity that is located_in the epithelium. It is the most common cause of leukoplakia and associated with the development of squamous cell carcinoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pharynx_carcinoma_in_situ rdfs:subClassOf :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :pharynx ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma of the pharynx that is located_in the epithelium. It is associated with the development of squamous cell carcinoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gallbladder_carcinoma_in_situ rdfs:subClassOf :gallbladder_disease,
        :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :gallbladder ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma located_in the surface epithelium of the gallbladder that most commonly develops into adenocarcinoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bile_duct_carcinoma_in_situ rdfs:subClassOf :bile_duct_disease,
        :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :bile_duct ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An in situ carcinoma located_in the surface epithelium of the bile duct that most commonly develops into adenocarcinoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bronchus_carcinoma_in_situ rdfs:subClassOf :bronchial_disease,
        :in_situ_carcinoma ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :in_situ_carcinoma ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :bronchus ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :bronchiole ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "An in situ carcinoma located_in the bronchus that most commonly develops into adenocarcinoma." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:respiratory_system_cancer rdfs:subClassOf :organ_system_cancer,
        :respiratory_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :respiratory_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system cancer located_in the respiratory system that is characterized by uncontrolled cellular proliferation in the respiratory tract." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paranasal_sinus_cancer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :paranasal_sinus ],
        :paranasal_sinus_disease,
        :respiratory_system_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :paranasal_sinus ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A respiratory system cancer that is located_in the paranasal sinuses." ;
    :has_exact_synonym "Epidermoid carcinoma of the paranasal sinus"@en,
        "Mucoepidermoid carcinoma of Accessory sinus"@en,
        "adenoid cystic carcinoma of Accessory sinus"@en,
        "paranasal sinus adenocarcinoma"@en,
        "paranasal sinus adenoid cystic carcinoma"@en,
        "paranasal sinus mucoepidermoid carcinoma"@en,
        "paranasal sinus squamous cell carcinoma"@en ;
    :has_related_synonym "adenoid cystic carcinoma of paranasal sinus"@en,
        "squamous cell carcinoma of paranasal sinus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infiltrating_renal_pelvis_transitional_cell_carcinoma rdfs:subClassOf :renal_pelvis_transitional_cell_carcinoma ;
    :has_definition "A renal pelvis transitional cell carcinoma located_in the transitional epithelium of the renal pelvis." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:respiratory_system_benign_neoplasm rdfs:subClassOf :organ_system_benign_neoplasm,
        :respiratory_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :respiratory_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system benign neoplasm that is located in the respiratory system which extends from the nasal sinuses to the diaphragm." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reproductive_organ_benign_neoplasm rdfs:subClassOf :organ_system_benign_neoplasm,
        :reproductive_system_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :reproductive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system benign neoplasm that is located_in reproductive system organs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bladder_benign_neoplasm rdfs:subClassOf :bladder_disease,
        :urinary_system_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :urinary_bladder ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A urinary system benign neoplasm located_in the bladder including papillomas, leiomyomas, fibromas, hemangiomas, neurofibromas and lipomas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastrointestinal_system_benign_neoplasm rdfs:subClassOf :gastrointestinal_system_disease,
        :organ_system_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :digestive_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An organ system benign neoplasm located_in gastrointestinal tract organs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biliary_tract_benign_neoplasm rdfs:subClassOf :biliary_tract_disease,
        :hepatobiliary_benign_neoplasm ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :benign_neoplasm ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :biliary_tree ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A hepatobiliary benign neoplasm located_in the biliary tract." ;
    :has_exact_synonym "extrahepatic bile duct neoplasm"@en,
        "neoplasm of extrahepatic bile ducts"@en,
        "tumor of the extrahepatic bile duct"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gastrointestinal_neuroendocrine_tumor rdfs:subClassOf :gastrointestinal_system_cancer ;
    :has_definition "A gastrointestinal system cancer that has_material_basis_in neuroendocrine cells." ;
    :has_exact_synonym "gastrointestinal neuroendocrine tumour"@en,
        "malignant gastrointestinal neuroendocrine tumor"@en,
        "malignant gastrointestinal neuroendocrine tumour"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:advanced_sleep_phase_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :sleep_disorder ;
    :has_definition "A sleep disorder that involves an altered circadian rhythm resulting in falling asleep in early evening and awaking very early in the morning." ;
    :has_exact_synonym "familial advanced sleep-phase syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aicardi_goutieres_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_inheritance ],
        :autosomal_genetic_disease,
        :syndrome ;
    :has_definition "A syndrome that is a genetically heterogeneous encephalopathy characterized in its most severe form by cerebral atrophy, leukodystrophy, intracranial calcifications, chronic cerebrospinal fluid lymphocytosis, increased CSF alpha-interferon, and negative serologic investigations for common prenatal infections." ;
    :has_exact_synonym "AGS",
        "Cree encephalitis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aland_island_eye_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :eye_disease,
        :x_linked_recessive_disease ;
    :has_definition "An eye disease characterized by fundus hypopigmentation, decreased visual acuity, nystagmus, astigmatism, myopia and defective darkness adaptation and has_material_basis_in mutation in the CACNA1F gene." ;
    :has_exact_synonym "FORSIUS-ERIKSSON TYPE OCULAR ALBINISM"@en,
        "Forsius-Eriksson syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:allan_herndon_dudley_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndrome,
        :x_linked_recessive_disease ;
    :has_definition "A syndrome that has_material_basis_in mutation at is in the gene encoding the monocarboxylate transporter-8 which alters the structure and function of the SLC16A2 protein which is then unable to transport the thyroid triiodothyronine (T3) hormone into nerve cells of the developing brain affecting normal brain development resulting in intellectual disability and problems with movement." ;
    :has_exact_synonym "AHDS"@en,
        "ALLAN-HERNDON SYNDROME"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oculocutaneous_albinism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by abnormal pigmentation of the skin, hair and eyes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocular_albinism_1 rdfs:subClassOf :eye_disease ;
    :has_definition "An eye disease that is characterized by reduced pigmentation of the iris and the resulting impairment of visual acuity without significantly affecting the color of skin or hair and has_material_basis_in mutation in the GPR143 gene that encodes segments of the melanosomes that stores melanin." ;
    :has_exact_synonym "Albinism ocular 1",
        "ocular albinism" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alopecia_universalis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :alopecia,
        :autosomal_recessive_disease ;
    :has_definition "An alopecia characterized by the complete loss of hair on the scalp and body." ;
    :has_exact_synonym "ALOPECIA UNIVERSALIS CONGENITA"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alternating_hemiplegia_of_childhood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :hemiplegia ;
    :has_definition "A hemiplegia characterized by recurrent episodes of temporary weakness or complete paralysis on one or both sides of the body." ;
    :has_exact_synonym "AHC"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_visceral_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :amyloidosis,
        :autosomal_dominant_disease,
        :inherited_metabolic_disorder ;
    :has_definition "An amyloidosis that is characterized by the abnormal deposition of amyloid proteins that is located_in the visceral organs, primarily the kidneys." ;
    :has_exact_synonym "AMYLOIDOSIS, FAMILIAL RENAL"@en,
        "German type amyloidosis"@en,
        "OSTERTAG TYPE AMYLOIDOSIS"@en,
        "systemic nonneuropathic amyloidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:finnish_type_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :facial_paralysis ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :lattice_corneal_dystrophy ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :zone_of_skin ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nerve ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cutis_laxa ],
        :autosomal_dominant_disease,
        :eye_disease,
        :primary_cutaneous_amyloidosis ;
    :has_definition "An amyloidosis that is characterized by abnormal deposits of amyloid protein that mainly affect the eyes, nerves and skin and has_material_basis_in mutations in the gelsolin gene (GSN), and has_symptom corneal lattice dystrophy, has_symptom bilateral facial paralysis, has_symptom cutis laxa." ;
    :has_exact_synonym "AGel amyloidosis",
        "Lattice corneal dystrophy type II",
        "gelsolin amyloidosis",
        "AMYLOIDOSIS, MERETOJA TYPE"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transthyretin_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :heart ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :nerve ],
        :amyloidosis,
        :autosomal_dominant_disease,
        :heart_disease,
        :inherited_metabolic_disorder ;
    :has_definition "An amyloidosis that is characterized by a loss of sensation in the extremities, cardiomyopathy, nephropathy, vitreous opacities, and CNS amyloidosis resulting from abnormal deposits of amyloid protein in the body's organs and tissues and has_material_basis_in autosomal dominant inheritance of mutations in the TTR gene." ;
    :has_exact_synonym "ATTR amyloidosis",
        "ATTRm amyloidosis",
        "paramyloidosis",
        "Amyloidosis, hereditary, transthyretin-related"@en,
        "Corino de Andrade's disease"@en,
        "Familial transthyretin amyloidosis"@en,
        "TTR amyloidosis"@en,
        "familial amyloid polyneuropathy"@en,
        "transthyretin-related hereditary amyloidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_cutaneous_amyloidosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :amyloidosis,
        :inherited_metabolic_disorder,
        :skin_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :amyloidosis ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An amyloidosis characterized by pruritus, skin scratching and by deposits of amyloid in the dermis." ;
    :has_exact_synonym "PCA"@en,
        "familial primary localized cutaneous amyloidosis"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anauxetic_dysplasia_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :anauxetic_dysplasia,
        :autosomal_recessive_disease ;
    :has_definition "An anauxetic dysplasia that has_material_basis_in homozygous or compound heterozygous mutation in the RMRP gene on chromosome 9p13." ;
    :has_exact_synonym "spondylometaepiphyseal dysplasia, Menger type"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rh_deficiency_syndrome rdfs:subClassOf :hemolytic_anemia ;
    :has_definition "A hemolytic anemia that is characterized by deficiency of Rh antigens, has_material_basis_in homozygous or compound heterozygous mutation in the RHAG gene on chromosome 6p12." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypochromic_microcytic_anemia rdfs:subClassOf :microcytic_anemia ;
    :has_definition "A microcytic anemia characterized by paler than normal blood cells." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arterial_calcification_of_infancy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :artery ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :artery_disease ;
    :has_definition "A vascular disease that is characterized by generalized calcification of the arterial internal elastic lamina, leading to rupture of the lamina and occlusive changes in the tunica intima with stenosis and decreased elasticity of the vessel wall." ;
    :has_exact_synonym "generalized arterial calcification of infancy"@en,
        "idiopathic infantile arterial calcification"@en,
        "infantile arteriosclerosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arterial_tortuosity_syndrome rdfs:subClassOf :connective_tissue_disease ;
    :has_definition "A connective tissue disease that is characterized by elongation and generalized tortuosity of the major arteries including the aorta." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:distal_arthrogryposis rdfs:subClassOf :muscle_tissue_disease ;
    :has_definition "A muscle tissue disease characterized by congenital joint contractures of hand and feet." ;
    :has_exact_synonym "Arthrogryposis Multiplex Congenita"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arts_syndrome rdfs:subClassOf :syndromic_x_linked_intellectual_disability ;
    :has_definition "An X-linked disease that is characterized by profound congenital sensorineural hearing impairment, early-onset hypotonia, delayed motor development, mild to moderate intellectual disability, ataxia, and increased risk of infection and has_material_basis_in mutations of the PRPS1 gene." ;
    :has_exact_synonym "ARTS"@en,
        "Lethal ataxia with deafness and optic atrophy"@en,
        "MRXS18"@en,
        "MRXSARTS"@en,
        "fatal X-linked ataxia with deafness and loss of vision"@en,
        "syndromic X-linked mental retardation 18"@en,
        "syndromic X-linked mental retardation Arts type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atelosteogenesis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :vertebral_column ],
        :osteochondrodysplasia,
        :spinal_disease ;
    :has_definition "An osteochondrodysplasia that is characterized by specific patterns of aplasia/hypoplasia of humeri, femora, spine in newborns." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atransferrinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :metal_metabolism_disorder ;
    :has_definition "A metal metabolism disorder that is characterized by transferrin deficiency, microcytic anemia, and iron loading, and has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the structural gene for transferrin (TF) on chromosome 3q22." ;
    :has_exact_synonym "familial hypotransferrinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:familial_atrial_fibrillation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :atrial_fibrillation ],
        :atrial_fibrillation ;
    :has_definition "An atrial fibrillation that has_material_basis_in autosomal dominant inheritance of the familial atrial fibrillation (ATFB) genes." ;
    :has_exact_synonym "ATFB"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atrioventricular_septal_defect rdfs:subClassOf :heart_septal_defect ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :heart_disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :atrioventricular_septum ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A congenital heart septal defect characterized by an abnormal or inadequate fusion of the superior and inferior endocardial cushions with the mid portion of the atrial septum and the muscular portion of the ventricular septum, thus allowing extra blood to circulate the lungs." ;
    :has_exact_synonym "AVCD"@en,
        "AVSD"@en,
        "ECD"@en,
        "atrioventricular canal defect"@en,
        "endocardial cushion defect"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:baller_gerold_syndrome rdfs:subClassOf :synostosis ;
    :has_definition "A synostosis characterized by coronal craniosynostosis, short stature, and aplasia or hypoplasia of the radial bone." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bamforth_lazarus_syndrome rdfs:subClassOf :hypothyroidism ;
    :has_definition "A hypothyroidism that is characterized by thyroid dysgenesis, cleft palate, spiky hair and bifid epiglottis, has_material_basis_in homozygous mutation in the FKHL15 gene on chromosome 9q22." ;
    :has_exact_synonym "HYPOTHYROIDISM, ATHYROIDAL, WITH SPIKY HAIR AND CLEFT PALATE"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pseudo_torch_syndrome_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by congenital microcephaly, intracranial calcifications, severe developmental delay, simplified gyration and polymicrogyria that has_material_basis_in homozygous or compound heterozygous mutation in the OCLN gene on chromosome 5q13.2." ;
    :has_exact_synonym "BLC-PMG"@en,
        "BLCPMG"@en,
        "Baraitser-Brett-Piesowicz syndrome"@en,
        "Baraitser-Reardon syndrome"@en,
        "PTORCH1"@en,
        "band-like calcification with simplified gyration and polymicrogyria"@en,
        "bilateral band-like calcification with polymicrogyria"@en,
        "microcephaly-intracranial calcification-intellectual disability syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bannayan_riley_ruvalcaba_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :cowden_syndrome ;
    :has_definition "A Cowden syndrome that is characterized by macrocephaly, multiple noncancerous tumors and hamartomas, and dark freckles on the penis, and has_material_basis_in heterozygous germline mutation in the PTEN gene on chromosome 10q23." ;
    :has_exact_synonym "Cowden syndrome 1",
        "Bannayan-Zonana syndrome"@en,
        "Riley-Smith syndrome"@en,
        "Ruvalcaba-Myhre-Smith syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bart_pumphrey_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by leukonychia, wart-like skin growths, palmoplantar keratoderma and hearing loss, has_material_basis_in heterozygous mutation in the GJB2 gene on chromosome 13q12." ;
    :has_exact_synonym "KNUCKLE PADS, LEUKONYCHIA, AND SENSORINEURAL DEAFNESS"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biotin_responsive_basal_ganglia_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :dystonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ataxia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :seizure ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :confusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysphagia ],
        :basal_ganglia_disease ;
    :has_definition "A basal ganglia disease that is characterized by recurrent subacute encephalopathy, has_symptom confusion, has_symptom seizure, has_symptom ataxia, has_symptom dystonia, has_symptom supranuclear facial palsy, has_symptom external ophthalmoplegia, and has_symptom dysphagia." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:beare_stevenson_cutis_gyrata_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by cutis gyrata, acanthosis nigricans and craniosynostosis, has_material_basis_in heterozygous mutation in the FGFR2 gene on chromosome 10q26." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitelliform_macular_dystrophy rdfs:subClassOf :macular_degeneration ;
    :has_definition "A macular degeneration that it is characterized by the disruption of cells in a small area near the center of the retina, the macula and may cause progressive vision loss." ;
    :has_exact_synonym "Best disease"@en,
        "Best macular dystrophy"@en,
        "juvenile-onset vitelliform macular dystrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bestrophinopathy rdfs:subClassOf :macular_degeneration ;
    :has_definition "A macular degeneration that is characterized by central vision loss, an absent electrooculogram light rise and a reduced electroretinogram, has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the BEST1 gene on chromosome 11q12." ;
    :has_exact_synonym "autosomal recessive bestrophinopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bethlem_myopathy rdfs:subClassOf :congenital_muscular_dystrophy ;
    :has_definition "A congenital muscular dystrophy that is characterized by myopathy and joint contractures that progresses slowly, has_material_basis_in autosomal dominant inheritance of heterozygous mutation in the COL6A1 gene, the COL6A2 gene, or the COL6A3 gene." ;
    :has_exact_synonym "benign congenital muscular dystrophy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bietti_crystalline_corneoretinal_dystrophy rdfs:subClassOf :retinal_degeneration ;
    :has_definition "A retinal degeneration that is characterized by crystals in the cornea, shiny deposits on the retina and progressive atrophy of the retina, choriocapillaris and choroid, has_material_basis_in autosomal recessive inheritance of homozygous or compound heterozygous mutation in the CYP4V2 gene on chromosome 4q35." ;
    :has_exact_synonym "Bietti's crystalline dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fetal_alcohol_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :pediatric_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_abnormality ],
        :fetal_alcohol_spectrum_disorder ;
    :has_definition "A fetal alcohol spectrum disorder that results in severe mental and physical defects which can develop in a child when the mother drinks alcohol during pregnancy. The presenting features include craniofacial dysmorphology (microcephaly, smooth philtrum, thin upper lip, small eye openings), pre- and postnatal growth deficiency, and central nervous system dysfunction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:partial_fetal_alcohol_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :pediatric_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_abnormality ],
        :fetal_alcohol_spectrum_disorder ;
    :has_definition "A fetal alcohol spectrum disorder that results in most, but not all, of the growth deficiency and/or craniofacial features of fetal alcohol syndrome including central nervous system dysfunction due to prenatal alcohol exposure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcohol_related_neurodevelopmental_disorder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_abnormality ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :pediatric_onset ],
        :fetal_alcohol_spectrum_disorder ;
    :has_definition "A fetal alcohol spectrum disorder that results in central nervous system dysfunction and behavioral and/or cognitive deficits due to prenatal alcohol exposure." ;
    :has_exact_synonym "ARND"@en,
        "static encephalopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcohol_related_birth_defects rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :pediatric_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :fetal_alcohol_spectrum_disorder ;
    :has_definition "A fetal alcohol spectrum disorder that results in damage to organs, bones, or muscles due to prenatal alcohol exposure." ;
    :has_exact_synonym "ARBD"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spastic_cerebral_palsy rdfs:subClassOf :cerebral_palsy ;
    :has_definition "A cerebral palsy that is caused by damage in the outer layer of the brain, the cerebral cortex, which results in increased tone, or tension, in a muscle causing abnormal movements." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxic_cerebral_palsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypotonia ],
        :cerebral_palsy ;
    :has_definition "A cerebral palsy that is caused by damage to the cerebellum, which affects muscle coordination, particularly in the limb. Some individuals suffer from hypotonia, tremors, difficulty with visual and/or auditory processing." ;
    :has_exact_synonym "hypotonic cerebral palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:female_breast_cancer rdfs:subClassOf :breast_cancer ;
    :has_definition "A breast cancer that develops from breast tissue in females." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dyskinetic_cerebral_palsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypotonia ],
        :cerebral_palsy ;
    :has_definition "A cerebral palsy that is caused by damage to the extrapyramidal motor system and/or pyramidal tract and to the basal ganglia, which results in mixed muscle tone (hypertonia and hypotonia). The individuals have trouble holding themselves in an upright, steady position for sitting or walking, and often show involuntary motions." ;
    :has_exact_synonym "Athetoid Dyskinetic Cerebral Palsy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mixed_cerebral_palsy rdfs:subClassOf :cerebral_palsy ;
    :has_definition "A cerebral palsy that is caused by injury to both the pyramidal and extra pyramidal areas of the brain, which results in both the tight muscle tone and the involuntary movements. The individual have difficulty with speaking and swallowing." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_bile_acid_synthesis_defect rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :steroid_inherited_metabolic_disorder ;
    :has_definition "A steroid inherited metabolic disorder characterized by abnormal conversion of cholesterol into bile acids which occurs predominantly in the liver." ;
    :has_exact_synonym "3-beta-hydroxy-delta-5-C27-steroid oxidoreductase deficiency"@en,
        "CBA"@en,
        "cholestasis with delta(4)-3-oxosteroid-5-beta-reductase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:birk_barel_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by intellectual disability, hypotonia, hyperactivity and facies, has_material_basis_in heterozygous mutation in the KCNK9 gene on chromosome 8q24." ;
    :has_exact_synonym "Birk-Barel mental retardation dysmorphism syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:birt_hogg_dube_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :skin_disease ;
    :has_definition "A skin disease that is characterized by hair follicle hamartomas, kidney tumors, and spontaneous pneumothorax, has_material_basis_in heterozygous mutation in the gene encoding folliculin (FLCN) on chromosome 17p11." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bjornstad_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by early onset of hearing loss and hair loss due to pili torti, has_material_basis_in homozygous or compound heterozygous mutation in the BCS1L gene on chromosome 2q35." ;
    :has_exact_synonym "BJS"@en,
        "PTD"@en,
        "deafness-pili torti-hypogonadism syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blau_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by familial granulomatous arthritis, uveitis and skin granulomas. It has_material_basis_in heterozygous mutations in the NOD2 gene." ;
    :has_exact_synonym "ARTHROCUTANEOUVEAL GRANULOMATOSIS"@en,
        "BLAUS"@en,
        "Jabs syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blue_cone_monochromacy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :achromatopsia,
        :x_linked_recessive_disease ;
    :has_definition "An achromatopsia that is characterized by severely impaired color discrimination, low visual acuity, nystagmus, photophobia due to the absence of functional long wavelength-sensitive and medium wavelength-sensitive cones in the retina and has_material_basis_in recessive X-linked inheritance." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:boomerang_dysplasia rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia that is characterized by severe dwarfism, dislocated joints, club feet, distinctive facies and dysplastic tubular bones with boomerang-like bowing, has_material_basis_in heterozygous mutation in the FLNB gene on chromosome 3p14." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:borjeson_forssman_lehmann_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :syndromic_x_linked_intellectual_disability,
        :x_linked_recessive_disease ;
    :has_definition "An X-linked disease that is characterized by intellectual disability, truncal obesity, seizures, hypogonadism, developmental delay, distinctive facial features, tapered fingers and short toes and has_material_basis_in X-linked recessive inheritance of mutations in the PHF6 gene." ;
    :has_exact_synonym "BFLS"@en,
        "BORJ"@en,
        "Borjeson syndrome"@en,
        "MRXSBFL"@en,
        "intellectual deficiency-epilepsy-endocrine disorders syndrome"@en,
        "mental retardation, epilepsy, and endocrine disorder"@en,
        "syndromic X-linked mental retardation Borjeson-Forssman-Lehmann type"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:athabaskan_brainstem_dysgenesis_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :brain_disease ;
    :has_definition "A brain disease that is characterized by brainstem dysgenesis, has_material_basis_in homozygous mutations in the HOXA1 gene." ;
    :has_exact_synonym "NAVAJO BRAINSTEM SYNDROME"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bothnia_retinal_dystrophy rdfs:subClassOf :fundus_dystrophy ;
    :has_definition "A fundus dystrophy that is characterized by early onset of night blindness and decreased visual acuity that progresses to blindness in early adulthood, has_material_basis_in mutation in RLBP1 gene." ;
    :has_exact_synonym "Vasterbotten dystrophy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bowen_conradi_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by growth delays, failure to thrive and malformations of the head and face that results in infantile death, has_material_basis_in homozygous mutation in the EMG1 gene on chromosome 12p13." ;
    :has_exact_synonym "BWCNS"@en,
        "Bowen Hutterite syndrome"@en,
        "Bowen-Conradi Hutterite syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:small_cell_carcinoma rdfs:subClassOf :carcinoma ;
    :has_definition "A carcinoma that is an undifferentiated neoplasm composed of primitive-appearing cells." ;
    :has_exact_synonym "Small cell carcinoma - intermediate cell"@en,
        "Small cell carcinoma, intermediate cell"@en,
        "intermediate cell small cell carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organ_system_cancer rdfs:subClassOf :cancer ;
    :has_definition "A cancer that is classified based on the organ it starts in." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cell_type_cancer rdfs:subClassOf :cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :derives_from ;
                                    owl:someValuesFrom :cell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A cancer that is classified by the type of cell from which it is derived." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anal_canal_cancer rdfs:subClassOf :large_intestine_cancer ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cancer ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :anal_canal ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A large intestine cancer that is located_in the terminal part of the large intestine." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachydactyly_syndactyly_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by brachydactyly and syndactyly, has_material_basis_in heterozygous mutation in the HOXD13 gene on chromosome 2q31." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brachyolmia rdfs:subClassOf :osteochondrodysplasia ;
    :has_definition "An osteochondrodysplasia characterized by generalized platyspondyly without significant long bone abnormalities and short stature." ;
    :has_exact_synonym "brachyrachia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:branchiooculofacial_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by low birth weight and growth retardation, bilateral branchial clefts." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brody_myopathy rdfs:subClassOf :atrophic_muscular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :skeletal_muscle_tissue ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A neuromuscular disease is characterized by difficulty relaxing muscles and muscle stiffness following exercise or other strenuous activity and is located in skeletal muscles." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brooke_spiegler_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :skin_disease ;
    :has_definition "A skin disease that is characterized by the development of several types of tumors from the skin, has_material_basis_in heterozygous mutation in the CYLD gene on chromosome 16q12." ;
    :has_exact_synonym "BRSS"@en,
        "BSS"@en,
        "CYLD cutaneous syndrome"@en,
        "SBS"@en,
        "Spiegler-Brooke Syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown_vialetto_van_laere_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by sensorineural hearing loss and a variety of cranial nerve palsies, usually involving the motor components of the seventh and ninth to twelfth cranial nerves." ;
    :has_exact_match "MESH:C537111" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_pleural_solitary_fibrous_tumor rdfs:subClassOf :pleural_cancer ;
    :has_definition "A pleural cancer that is located_in mesenchymal cells in the areolar tissue subjacent to the mesothelial-lined pleura." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fetal_alcohol_spectrum_disorder rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_disease_driver ;
            owl:someValuesFrom :alcohol ],
        :specific_developmental_disorder ;
    :has_definition "A specific developmental disorder and physical disorder that is characterized by physical, behavioral and learning birth defects resulting from maternal ingestion of alcohol during pregnancy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chorioamnionitis rdfs:subClassOf :placenta_disease ;
    :has_definition "A placenta disease that is an inflammation of the fetal membranes (amnion and chorion) due to a bacterial infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:funisitis rdfs:subClassOf :connective_tissue_disease ;
    :has_definition "A connective tissue disease that is an inflammation of the connective tissue of the umbilical cord." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dent_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :renal_tubular_transport_disease,
        :x_linked_recessive_disease ;
    :has_definition "A renal tubular transport disease that is characterized by tubular proteinuria, hypercalciuria, calcium nephrolithiasis, nephrocalcinosis and chronic kidney failure and has_material_basis_in X-linked recessive inheritance of mutations in the CLCN5 gene or OCRL1 gene." ;
    :has_exact_synonym "Dent disease 1"@en,
        "Dent disease 2"@en,
        "Dent's disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cardiomyopathy rdfs:subClassOf :heart_disease ;
    :has_definition "A heart disease and a myopathy that is characterized by deterioration of the function of the heart muscle." ;
    :has_exact_synonym "Cardiomyopathies"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:electroclinical_syndrome rdfs:subClassOf :epilepsy ;
    :has_definition "An epilepsy syndrome that is a group of clinical entities showing a cluster of electro-clinical characteristics, classified according to age at onset, cognitive and developmental antecedents and consequences, motor and sensory examinations, EEG features, provoking or triggering factors, and patterns of seizure occurrence with respect to sleep." ;
    :has_exact_synonym "electro-clinical syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_period_electroclinical_syndrome rdfs:subClassOf :electroclinical_syndrome ;
    :has_definition "An electroclinical syndrome with onset in the neonatal period less than 44 weeks of gestational age." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:infancy_electroclinical_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :infantile_onset ],
        :electroclinical_syndrome ;
    :has_definition "An electroclinical syndrome with onset in infancy occurring between birth and one year of age." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_electroclinical_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :absence_epilepsy ;
    :has_definition "An electroclinical syndrome with onset in childhood between one and 12 years of age." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adolescence_adult_electroclinical_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :adult_onset ;
                            rdf:rest [ rdf:first :young_adult_onset ;
                                    rdf:rest :nil ] ] ] ],
        :absence_epilepsy ;
    :has_definition "An electroclinical syndrome with onset in adolescence and adulthood." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:variable_age_at_onset_electroclinical_syndrome rdfs:subClassOf :electroclinical_syndrome ;
    :has_definition "An electroclinial syndrome that is characterized by development of seizures later in life with a variable age of onset and duration." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:early_onset_absence_epilepsy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_electroclinical_syndrome ;
    :has_definition "A childhood electroclinical syndrome characterized by the occurrence of typical absence seizures starting between the age of four and ten years." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:early_infantile_epileptic_encephalopathy rdfs:subClassOf :neonatal_period_electroclinical_syndrome ;
    :has_definition "A neonatal period electroclinical syndrome that is characterized by tonic spasms and partial seizures." ;
    :has_exact_synonym "Early Infantile Epileptic Encephalopathy with Burst-Suppression"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:3_methylcrotonyl_coa_carboxylase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :poor_feeding ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :lethargy ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypotonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :skeletal_muscle_atrophy ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :amino_acid_metabolic_disorder,
        :autosomal_recessive_disease,
        :muscular_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :amino_acid_metabolic_disorder ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :muscle_tissue ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An amino acid metabolic disorder that is classified by inadequate levels of the enzyme 3-methylcrotonyl-CoA carboxylase that helps break down proteins containing the amino acid leucine. This disease has_symptom muscular hypotonia (weak muscle tone), has_symptom muscular atrophy, has_symptom feeding difficulties, has_symptom recurrent episodes of vomiting and diarrhea, and has_symptom lethargy." ;
    :has_exact_synonym "3-Methylcrotonylglycinuria"@en,
        "3MCC deficiency"@en,
        "BMCC deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aceruloplasminemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :inherited_metabolic_disorder,
        :iron_metabolism_disease ;
    :has_definition "An iron metabolism disease that has_material_basis_in a mutation in the ceruloplasmin gene characterized by progressive neurodegeneration of the retina and basal ganglia and diabetes mellitus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agat_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :cerebral_creatine_deficiency_syndrome ;
    :has_definition "An amino acid metabolic disorder that has_material_basis_in a mutation in the GATM gene resulting in deficiency of arginine:glycine amidinotransferase which then limits creatine synthesis." ;
    :has_exact_synonym "Cerebral creatine deficiency syndrome 3"@en,
        "arginine glycine amidinotransferase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cox_deficiency_infantile_mitochondrial_myopathy rdfs:subClassOf :cytochrome_c_oxidase_deficiency_disease ;
    :has_definition "A cytochrome-c oxidase deficiency disease characterized by myotonia, abnormalities of the heart and kidneys, and lactic acidosis." ;
    :has_exact_match "ORDO:1561",
        "UMLS_CUI:C4273730" ;
    :has_exact_synonym "fatal infantile cardioencephalomyopathy due to cytochrome c oxidase deficiency",
        "cardioencephalomyopathy, fatal infantile, due to cytochrome c oxidase deficiency"@en,
        "fatal infantile COX deficiency"@en,
        "fatal infantile cytochrome C oxidase deficiency"@en,
        "fatal infantile encephalocardiomyopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_aciduria_and_homocystinuria_type_cblc rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :digenic_inheritance ],
        :digenic_disease,
        :methylmalonic_acidemia ;
    :has_definition "A methylmalonic acidemia that has_material_basis_in deficiency in synthesis of both AdoCbl and MeCbl (cblC) and is characterized by decreased levels of the coenzymes adenosylcobalamin (AdoCbl) and methylcobalamin (MeCbl), which results in decreased activity of the respective enzymes methylmalonyl-CoA mutase." ;
    :has_exact_synonym "MAHCC",
        "Cobalamin C deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_aciduria_and_homocystinuria_type_cbld rdfs:subClassOf :methylmalonic_acidemia ;
    :has_definition "A methylmalonic aciduria that is characterized by combined homocystinuria and methylmalonic aciduria and deficiency of MCM and MS activities." ;
    :has_exact_synonym "MAHCD",
        "Cobalamin D deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_aciduria_and_homocystinuria_type_cblf rdfs:subClassOf :methylmalonic_acidemia ;
    :has_definition "A methylmalonic acidemia that is characterized by the accumulation of cobalamin in lysosomes which is then unable to synthesize the cofactors adenosylcobalamin (AdoCbl) and methylcobalamin (MeCbl) and that has_material_basis_in homozygous or compound heterozygous mutation in the LMBRD1 gene on chromosome 6q13." ;
    :has_exact_synonym "MAHCF",
        "Cobalamin F deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitamin_metabolic_disorder rdfs:subClassOf :inherited_metabolic_disorder ;
    :has_definition "An inherited metabolic disorder resulting from a deficiency in vitamin or vitamin cofactor transport or metabolism." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebral_folate_receptor_alpha_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebrum ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :vitamin_metabolic_disorder ;
    :has_definition "A vitamin metabolic disorder that has_material_basis_in mutations in the folate receptor 1 (FOLR1) gene coding for folate receptor alpha (FRalpha), is located_in the brain and is characterized by progressive movement disturbance, psychomotor decline, and epilepsy." ;
    :has_exact_synonym "Neurodegeneration due to cerebral folate transport deficiency" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ornithine_translocase_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :ammonia ],
        :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that has_material_basis_in deficiency of ornithine translocase resulting in the accumulation of ammonia in the blood." ;
    :has_exact_synonym "HHH syndrome"@en,
        "Hyperornithinemia-Hyperammonemia-Homocitrullinuria (HHH) syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:serine_deficiency rdfs:subClassOf :amino_acid_metabolic_disorder ;
    :has_definition "An amino acid metabolic disorder that has_material_basis_in defects in the biosynthesis of the amino acid L-serine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phgdh_deficiency rdfs:subClassOf :serine_deficiency ;
    :has_definition "A serine deficiency that has_material_basis_in deficiency of phosphoglycerate dehydrogenase which results in a disruption of L-serine biosynthesis." ;
    :has_exact_synonym "PHOSPHOGLYCERATE DEHYDROGENASE DEFICIENCY"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:psat_deficiency rdfs:subClassOf :serine_deficiency ;
    :has_definition "A serine deficiency that has_material_basis_in deficiency of phosphoserine aminotransferase and is characterized by low concentartions of serine and flycine in plasma and cerebrospinal fluid." ;
    :has_exact_synonym "Phosphoserine aminotransferase deficiency"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:psph_deficiency rdfs:subClassOf :serine_deficiency ;
    :has_definition "A serine deficiency that has_material_basis_in deficiency of phosphoserine phosphatase impeding the synthesis of L-serine." ;
    :has_exact_synonym "PSPHD"@en,
        "Phosphoserine phosphatase deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tyrosinemia_type_ii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :keratitis ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypertyrosinemia ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :palmoplantar_hyperkeratosis ],
        :liver_disease,
        :skin_disease,
        :tyrosinemia ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :amino_acid_metabolic_disorder ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :disease_has_location ;
                                    owl:someValuesFrom :zone_of_skin ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :disease_has_location ;
                                            owl:someValuesFrom :liver ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A tyrosinemia that has_material_basis_in deficiency of hepatic tyrosine aminotransferase located_in the liver and is characterized by keratitis, painful palmoplantar hyperkeratosis, mental retardation, and elevated serum tyrosine levels." ;
    :has_exact_synonym "Oculocutaneous tyrosinemia"@en,
        "Richner-Hanhart syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tyrosinemia_type_i rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypertyrosinemia ],
        :tyrosinemia ;
    :has_definition "A tyrosinemia that has_material_basis_in deficiency of the enzyme fumarylacetoacetate hydrolase resulting in an increase in fumarylacetoacetate which inhibits previous steps in tyrosine degradation leading to an accumulation of tyrosine in the body." ;
    :has_exact_synonym "hepatorenal tyrosinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tyrosinemia_type_iii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypertyrosinemia ],
        :tyrosinemia ;
    :has_definition "A tyrosinemia that has_material_basis_in deficiency of 4-hydroxyphenylpyruvate dioxygenase disrupting the break down of tyrosine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glycogen_metabolism_disorder rdfs:subClassOf :carbohydrate_metabolic_disorder ;
    :has_definition "A carbohydrate metabolism disorder that is characterized by abnormal accumulation or depletion of liver glycogen." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chanarin_dorfman_syndrome rdfs:subClassOf :lipid_storage_disease ;
    :has_definition "A lipid storage disease that is characterized by accumulation of triglycerides in the cytoplasm of leukocytes, muscle, liver, fibroblasts, and other tissues." ;
    :has_exact_synonym "neutral lipid storage disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coenzyme_q10_deficiency_disease rdfs:subClassOf :mitochondrial_metabolism_disease ;
    :has_definition "A mitochondrial metabolism disease that is characterized by a deficiency of CoQ10 resulting from reduced biosynthesis." ;
    :has_exact_synonym "COENZYME Q10 DEFICIENCY, PRIMARY"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vitamin_b12_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :abnormal_vitamin_b12_level ],
        :vitamin_metabolic_disorder ;
    :has_definition "A vitamin metabolic disorder that results from low blood levels of vitamin B12." ;
    :has_exact_synonym "cobalamin deficiency"@en,
        "hypocobalaminemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_aciduria_and_homocystinuria_type_cble rdfs:subClassOf :methylmalonic_acidemia ;
    :has_definition "A methylmalonic acidemia that is characterized by megaloblastic anemia, lethargy, failure to thrive, developmental delay, intellectual deficit and seizures, has_material_basis_in homozygous or compound heterozygous mutation in the MTRR gene on chromosome 5p15 that causes inborn error of vitamin B12 metabolism." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methylmalonic_aciduria_and_homocystinuria_type_cblg rdfs:subClassOf :methylmalonic_acidemia ;
    :has_definition "A methylmalonic acidemia that is characterized by megaloblastic anemia, lethargy, failure to thrive, developmental delay, intellectual deficit and seizures, has_material_basis_in homozygous or compound heterozygous mutation in the MTR gene on chromosome 1q43 that causes an inborn error of vitamin B12 metabolism." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:congenital_intrinsic_factor_deficiency rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :abnormality_of_prenatal_development_or_birth ],
        :physical_disorder,
        :vitamin_b12_deficiency ;
    :has_definition "A vitamin B12 deficiency that is characterized by megaloblastic anemia due to the absence of gastric intrinsic factor which results in abnormal vitamin B12 absorption." ;
    :has_exact_synonym "hereditary intrinsic factor deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:x_linked_monogenic_disease rdfs:subClassOf :monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :x_linked_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A monogenic disease that has_material_basis_in mutations in genes on the X chromosome." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_disease rdfs:subClassOf :autosomal_genetic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :autosomal_dominant_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An autosomal genetic disease that is characterized by the presence of one disease-associated mutation of a gene which is sufficient to cause the disease." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_recessive_disease rdfs:subClassOf :autosomal_genetic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :autosomal_recessive_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An autosomal genetic disease that is characterized by the presence of two mutated copies of the gene, both of which must be present in order for the disease or trait to develop." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:y_linked_monogenic_disease rdfs:subClassOf :monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :y_linked_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A monogenic disease that has_material_basis_in mutations on the Y chromosome." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_genetic_disease rdfs:subClassOf :monogenic_disease ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :disease ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :autosomal_inheritance ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A monogenic disease that has_material_basis_in a mutation in a single gene on one of the non-sex chromosomes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:qazi_markouizos_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :hypotonia ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :dysharmonic_delayed_bone_age ],
        :syndrome ;
    :has_definition "A syndrome that is characterized by hypotonia, congenital fiber type disproportion and dysharmonic skeletal maturation." ;
    :has_exact_synonym "Dysharmonic skeletal maturation - muscular fibre disproportion"@en,
        "Qazi-Markouizos syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alcohol_dependence rdfs:subClassOf :substance_dependence ;
    :has_definition "A substance dependence that is characterized by tolerance, withdrawal symptoms, increasing use, persistent desire to decrease consumption, time spent obtaining or recovering from alcohol caused by a physical and psychological dependence on alcohol." ;
    :has_exact_synonym "alcoholism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nicotine_dependence rdfs:subClassOf :substance_dependence ;
    :has_definition "A substance dependence that is characterized by a physical dependence on nicotine." ;
    :has_exact_synonym "tobacco use disorder"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mature_t_cell_and_nk_cell_lymphoma rdfs:subClassOf :t_cell_non_hodgkin_lymphoma ;
    :has_definition "A T-cell non-Hodgkin lymphoma that has_material_basis_in mature T lymphocytes and natural killer cells." ;
    :has_exact_synonym "NK-T cell lymphoma"@en,
        "mature T-cell and natural killer cell lymphoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anaplastic_large_cell_lymphoma rdfs:subClassOf :non_hodgkin_lymphoma ;
    :has_definition "A non-Hodgkin lymphoma involving aberrant T-cells." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diffuse_large_b_cell_lymphoma rdfs:subClassOf :b_cell_lymphoma ;
    :has_definition "A B-cell lymphoma that is a cancer of B cells presenting as an aggressive tumour which can arise in virtually any part of the body." ;
    :has_exact_synonym "DLBCL" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mantle_cell_lymphoma rdfs:subClassOf :b_cell_lymphoma ;
    :has_definition "A B-cell lymphocytic neoplasm due to CD5 positive antigen-naive pregerminal center B-cell within the mantle zone that surrounds normal germinal center follicles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marginal_zone_lymphoma rdfs:subClassOf :b_cell_lymphoma ;
    :has_definition "A B-cell lymphoma arising from the marginal zone of lymphoid tissues that is characterized by the presence of small to medium sized atypical lymphocytes." ;
    :has_exact_synonym "marginal zone B-cell lymphoma",
        "marginal zone lymphoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:peripheral_t_cell_lymphoma rdfs:subClassOf :mature_t_cell_and_nk_cell_lymphoma ;
    :has_definition "A mature T-cell and NK-cell lymphoma includes a group of T-cell lymphomas that develop away from the thymus." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:splenic_marginal_zone_lymphoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :bone_marrow ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :spleen ],
        :bone_marrow_cancer,
        :marginal_zone_lymphoma,
        :spleen_cancer ;
    :has_definition "A marginal zone B-cell lymphocyte located_in the spleen comprised of B-cells in place of white pulp." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:t_cell_large_granular_lymphocyte_leukemia rdfs:subClassOf :t_cell_acute_lymphoblastic_leukemia ;
    :has_definition "A T-cell acute lymphocytic leukemia that exhibits an unexplained, chronic (greater than 6 months) elevation in large granular lymphocytes (LGLs) in the peripheral blood." ;
    :has_exact_synonym "Large granular lymphocytic leukaemia"@en,
        "Large granular lymphocytic leukemia"@en,
        "T-cell large granular lymphocyte leukaemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amyotrophic_lateral_sclerosis_type_8 rdfs:subClassOf :amyotrophic_lateral_sclerosis ;
    :has_definition "An amyotrophic lateral sclerosis that has_material_basis_in mutation in the VAPB gene on chromosome 20." ;
    :has_exact_synonym "ALS8"@en,
        "amyotrophic lateral sclerosis 8"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellar_ataxia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :cerebellum ],
        :cerebellar_disease,
        :hereditary_ataxia ;
    :has_definition "A hereditary ataxia that is characterized by ataxia originating in the cerebellum." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ataxia_with_oculomotor_apraxia_type_1 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by progressive cerebellar ataxia including oculomotor apraxia, severe neuropathy and hypoalbuminemia, has_material_basis_in autosomal recessive inheritance of mutation in the APTX gene." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinocerebellar_ataxia_with_axonal_neuropathy_2 rdfs:subClassOf :autosomal_recessive_cerebellar_ataxia ;
    :has_definition "An autosomal recessive cerebellar ataxia that is characterized by the onset of ataxia between age three and thirty including axonal sensorimotor neuropathy, cerebellar atrophy and elevated alpha-fetoprotein that has_material_basis_in homozygous or compound heterozygous mutation in the SETX gene on chromosome 9q34.13. Oculomotor apraxia is common, but not universal." ;
    :has_exact_synonym "AOA2",
        "SCAN2",
        "SCAR1",
        "ataxia with oculomotor apraxia type 2",
        "autosomal recessive spinocerebellar ataxia 1",
        "autosomal recessive spinocerebellar ataxia with axonal neuropathy 2",
        "spinocerebellar ataxia with axonal neuropathy type 2" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:deafness_dystonia_optic_neuronopathy_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :structural_variant ],
        :mitochondrial_metabolism_disease ;
    :has_definition "A mitochondrial metabolism disease that is characterized by hearing loss that begins early in life, problems with movement, impaired vision, and behavior problems, and has_material_basis_in mutations in the TIMM8A gene resulting in abnormal protein transport within the mitochondria." ;
    :has_exact_synonym "Deafness Dystonia Optic Atrophy Syndrome"@en,
        "Deafness Dystonia Optic Neuronopathy Syndrome"@en,
        "Dystonia Deafness Syndrome"@en,
        "Jensen syndrome"@en,
        "Mohr-Tranebjaerg syndrome"@en,
        "deafness dystonia syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:metabolic_acidosis rdfs:subClassOf :acquired_metabolic_disease ;
    :has_definition "An acquired metabolic disease that characterized by excessive production of acid." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:myotonic_dystrophy_type_2 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :myotonic_disease ;
    :has_definition "A myotonic disease that is characterized by myotonia and progressive, proximal muscle wasting and weakness affecting the skeletal and smooth muscles of the neck, shoulders, elbows and hips and has_material_basis_in the autosomal dominant inheritance of the CNBP (ZNF9) gene containing an expansion of a CCTG repeat in intron one." .
